INSERT INTO `quotes` VALUES
(1,1,1,1,'Denke lieber an das, was du hast, als an das, was dir fehlt! Suche von den Dingen, die du hast, die besten aus und bedenke dann, wie eifrig du nach ihnen gesucht haben würdest, wenn du sie nicht hättest.',4066,0,0,'2022-06-04 08:11:25'),
(2,1,2,1,'Wir denken selten an das, was wir haben, aber immer an das, was uns fehlt.',4023,0,0,'2022-06-04 08:11:26'),
(3,1,3,1,'Verweile nicht in der Vergangenheit, träume nicht von der Zukunft. Konzentriere dich auf den gegenwärtigen Moment.',3231,0,0,'2022-06-04 08:11:26'),
(4,1,4,1,'Es ist ein großer Fehler zu denken, dass ein Mensch immer gleich ist. Ein Mensch ist nie lange derselbe. Er verändert sich ständig. Nicht einmal für eine halbe Stunde bleibt er derselbe.',2397,0,0,'2022-06-04 08:11:26'),
(5,1,5,1,'Freundschaft ist die reinste und höchste Form der Liebe. Es ist eine Form der Liebe ohne Bedingungen und Erwartungen, bei der man das Geben an sich genießt.',2334,0,0,'2022-06-04 08:11:26'),
(6,1,3,1,'Jedes Leben hat sein Maß an Leid. Manchmal bewirkt eben dieses unser Erwachen.',1905,0,0,'2022-06-04 08:11:26'),
(7,1,6,1,'Du siehst die Welt nicht so wie sie ist, du siehst die Welt so wie du bist.',1903,0,0,'2022-06-04 08:11:27'),
(8,1,7,1,'Zeit ist überhaupt nicht kostbar, denn sie ist eine Illusion. Was dir so kostbar erscheint, ist nicht die Zeit, sondern der einzige Punkt, der außerhalb der Zeit liegt: das Jetzt. Das allerdings ist kostbar. Je mehr du dich auf die Zeit konzentrierst, auf Vergangenheit und Zukunft, desto mehr verpasst du das Jetzt, das Kostbarste, was es gibt.',1894,0,0,'2022-06-04 08:11:27'),
(9,1,8,1,'Vergiss Sicherheit. Lebe, wo du fürchtest zu leben. Zerstöre deinen Ruf. Sei berüchtigt.',1812,0,0,'2022-06-04 08:11:27'),
(10,1,9,1,'Dumme Gedanken hat jeder, aber der Weise verschweigt sie.',1796,0,0,'2022-06-04 08:11:27'),
(11,1,7,1,'Du kannst dich nicht selber finden, indem du in die Vergangenheit gehst. Du findest dich selber, indem du in die Gegenwart kommst.',1778,0,0,'2022-06-04 08:11:27'),
(12,1,10,1,'Zwei Dinge sind unendlich, das Universum und die menschliche Dummheit, aber bei dem Universum bin ich mir noch nicht ganz sicher.',1739,0,0,'2022-06-04 08:11:28'),
(13,1,3,1,'Es gibt keinen Weg zum Glück. Glücklich-sein ist der Weg.',1580,0,0,'2022-06-04 08:11:28'),
(14,1,10,1,'Phantasie ist wichtiger als Wissen, denn Wissen ist begrenzt.',1417,0,0,'2022-06-04 08:11:28'),
(15,1,11,1,'Es gibt nur zwei Tage im Jahr, an denen man nichts tun kann. Der eine ist Gestern, der andere Morgen. Dies bedeutet, dass heute der richtige Tag zum Lieben, Glauben und in erster Linie zum Leben ist.',1375,0,0,'2022-06-04 08:11:28'),
(16,1,3,1,'Wenn du ein Problem hast, versuche es zu lösen. Kannst du es nicht lösen, dann mache kein Problem daraus.',1375,0,0,'2022-06-04 08:11:28'),
(17,1,12,1,'Der Kluge lernt aus allem und von jedem, der Normale aus seinen Erfahrungen und der Dumme weiß alles besser.',1278,0,0,'2022-06-04 08:11:29'),
(18,1,13,1,'Diejenigen die wir lieben, können uns am meisten verletzen.',1269,0,0,'2022-06-04 08:11:29'),
(19,1,14,1,'Immer die Wahrheit sagen bringt einem wahrscheinlich nicht viele Freunde, aber dafür die Richtigen.',1232,0,0,'2022-06-04 08:11:29'),
(20,1,7,1,'Wenn du dein Hier und Jetzt unerträglich findest und es dich unglücklich macht, dann gibt es drei Möglichkeiten: Verlasse die Situation, verändere sie oder akzeptiere sie ganz. Wenn du Verantwortung für dein Leben übernehmen willst, dann musst du eine dieser drei Möglichkeiten wählen, und du musst die Wahl jetzt treffen.',1230,0,0,'2022-06-04 08:11:29'),
(21,1,3,1,'Lerne loszulassen, das ist der Schlüssel zum Glück.',1199,0,0,'2022-06-04 08:11:29'),
(22,1,15,1,'Mir ist egal ob du schwarz, weiß, hetero, bisexuell, schwul, lesbisch, klein, groß, fett, dünn, reich oder arm bist. Wenn du nett zu mir bist, werde ich auch nett zu dir sein. Ganz einfach.',1159,0,0,'2022-06-04 08:11:29'),
(23,1,3,1,'Niemals in der Welt hört Hass durch Hass auf. Hass hört durch Liebe auf.',1094,0,0,'2022-06-04 08:11:30'),
(24,1,16,1,'Wer glaubt, ein Christ zu sein, weil er die Kirche besucht, irrt sich. Man wird ja auch kein Auto, wenn man in eine Garage geht.',1064,0,0,'2022-06-04 08:11:30'),
(25,1,10,1,'Wenn die Menschen nur über das sprächen, was sie begreifen, dann würde es sehr still auf der Welt sein.',986,0,0,'2022-06-04 08:11:30'),
(26,1,5,1,'Fange an, diesen Moment zu leben und du wirst sehen - je mehr du lebst, desto weniger Probleme wird es geben.',908,0,0,'2022-06-04 08:11:30'),
(27,1,3,1,'Wir sind, was wir denken. Alles, was wir sind, entsteht aus unseren Gedanken. Mit unseren Gedanken formen wir die Welt.',887,0,0,'2022-06-04 08:11:31'),
(28,1,17,1,'Am Ende werden wir uns nicht an die Worte unserer Feinde erinnern, sondern an das Schweigen unserer Freunde.',850,0,0,'2022-06-04 08:11:31'),
(29,1,9,1,'Glück entsteht oft durch Aufmerksamkeit in kleinen Dingen, Unglück oft durch Vernachlässigung kleiner Dinge.',815,0,0,'2022-06-04 08:11:31'),
(30,1,5,1,'Vergiss die Idee, Jemand zu werden - du bist schon ein Meisterstück. Du kannst nicht verbessert werden. Du musst es nur erkennen, realisieren.',796,0,0,'2022-06-04 08:11:31'),
(31,1,3,1,'Niemand rettet uns, außer wir selbst. Niemand kann und niemand darf das. Wir müssen selbst den Weg gehen.',795,0,0,'2022-06-04 08:11:31'),
(32,1,11,1,'Falls du glaubst, dass du zu klein bist, um etwas zu bewirken, dann versuche mal zu schlafen, wenn eine Mücke im Raum ist.',775,0,0,'2022-06-04 08:11:31'),
(33,1,13,1,'Liebe ist was dich lächeln lässt wenn du müde bist.',763,0,0,'2022-06-04 08:11:32'),
(34,1,1,1,'Die Seele hat die Farbe deiner Gedanken.',727,0,0,'2022-06-04 08:11:32'),
(35,1,18,1,'Es ist kein Anzeichen von seelischer Gesundheit sich an eine zutiefst gestörte Gesellschaft anpassen zu können.',716,0,0,'2022-06-04 08:11:32'),
(36,1,11,1,'In der Wut verliert der Mensch seine Intelligenz.',710,0,0,'2022-06-04 08:11:32'),
(37,1,13,1,'Was andere Menschen von dir denken ist nicht dein Problem.',706,0,0,'2022-06-04 08:11:32'),
(38,1,10,1,'Wer keinen Sinn im Leben sieht, ist nicht nur unglücklich, sondern kaum lebensfähig.',689,0,0,'2022-06-04 08:11:33'),
(39,1,16,1,'Das schönste Denkmal, das ein Mensch bekommen kann, steht in den Herzen der Mitmenschen.',687,0,0,'2022-06-04 08:11:33'),
(40,1,19,1,'Ein weises Mädchen küsst, aber liebt nicht, hört zu, aber glaubt nicht und verlässt, bevor sie verlassen wird.',678,0,0,'2022-06-04 08:11:33'),
(41,1,3,1,'Wer seinen Wohlstand vermehren möchte, der sollte sich an den Bienen ein Beispiel nehmen. Sie sammeln den Honig, ohne die Blumen zu zerstören. Sie sind sogar nützlich für die Blumen. Sammle deinen Reichtum, ohne seine Quellen zu zerstören, dann wird er beständig zunehmen.',658,0,0,'2022-06-04 08:11:33'),
(42,1,3,1,'Es nützt nichts, nur ein guter Mensch zu sein, wenn man nichts tut!',655,0,0,'2022-06-04 08:11:33'),
(43,1,3,1,'Der Weg liegt nicht im Himmel. Der Weg liegt im Herzen.',647,0,0,'2022-06-04 08:11:34'),
(44,1,5,1,'Wenn du dich selbst liebst, liebst du deine Mitmenschen. Wenn du dich selbst hasst, hasst du deine Mitmenschen. Deine Beziehung zu den anderen ist nur ein Spiegelbild von dir selbst.',643,0,0,'2022-06-04 08:11:34'),
(45,1,5,1,'Jeder Mensch kommt mit einem speziellen Schicksal auf diese Welt. Er hat etwas zu vollbringen, eine Nachricht zu vermitteln, eine Arbeit fertigzustellen.',634,0,0,'2022-06-04 08:11:34'),
(46,1,15,1,'Liebe ist nur ein Wort, aber du selbst definierst es.',624,0,0,'2022-06-04 08:11:34'),
(47,1,13,1,'Eines Tages wirst du aufwachen und keine Zeit mehr haben für die Dinge, die du immer wolltest. Tu sie jetzt.',619,0,0,'2022-06-04 08:11:34'),
(48,1,10,1,'Ich fürchte mich vor dem Tag, an dem die Technologie unsere Menschlichkeit übertrifft. Auf der Welt wird es nur noch eine Generation aus Idioten geben.',596,0,0,'2022-06-04 08:11:35'),
(49,1,20,1,'Man muß das Unmögliche versuchen, um das Mögliche zu erreichen.',592,0,0,'2022-06-04 08:11:35'),
(50,1,21,1,'Ein tiefer Fall führt oft zu hohem Glück.',589,0,0,'2022-06-04 08:11:35'),
(51,1,5,1,'Lebe dein Leben auf alle möglichen Arten - gut-schlecht, bitter-süß, dunkel-hell, Sommer-Winter. Lebe alle Dualitäten. Habe keine Angst Erfahrungen zu machen, denn umso mehr Erfahrung du hast, umso reifer wirst du werden.',581,0,0,'2022-06-04 08:11:35'),
(52,1,22,1,'Der Schwache kann nicht verzeihen. Verzeihen ist eine Eigenschaft des Starken.',578,0,0,'2022-06-04 08:11:35'),
(53,1,10,1,'Wenn ich mit meiner Relativitätstheorie recht behalte, werden die Deutschen sagen, ich sei Deutscher, und die Franzosen, ich sei Weltbürger. Erweist sich meine Theorie als falsch, werden die Franzosen sagen, ich sei Deutscher, und die Deutschen, ich sei Jude.',570,0,0,'2022-06-04 08:11:36'),
(54,1,5,1,'Sei - versuche nicht, zu werden.',566,0,0,'2022-06-04 08:11:36'),
(55,1,10,1,'Ich bin nicht sicher, mit welchen Waffen der dritte Weltkrieg ausgetragen wird, aber im vierten Weltkrieg werden sie mit Stöcken und Steinen kämpfen.',547,0,0,'2022-06-04 08:11:36'),
(56,1,3,1,'Du wirst morgen sein, was Du heute denkst.',531,0,0,'2022-06-04 08:11:36'),
(57,1,23,1,'Wenn du damit beginnst, dich denen aufzuopfern, die du liebst, wirst du damit enden, die zu hassen, denen du dich aufgeopfert hast.',529,0,0,'2022-06-04 08:11:36'),
(58,1,11,1,'Denke daran, dass etwas, was du nicht bekommst, manchmal eine wunderbare Fügung des Schicksals sein kann.',528,0,0,'2022-06-04 08:11:37'),
(59,1,10,1,'Das Schönste, was wir erleben können, ist das Geheimnisvolle.',524,0,0,'2022-06-04 08:11:37'),
(60,1,9,1,'Was man ernst meint, sagt man am besten im Spaß.',524,0,0,'2022-06-04 08:11:37'),
(61,1,17,1,'Ich habe zuviel Hass gesehen, als dass ich selber hassen möchte.',503,0,0,'2022-06-04 08:11:37'),
(62,1,13,1,'Warten ist schmerzhaft. Vergessen ist schmerzhaft. Aber nicht zu wissen, was davon man tun soll, ist das Schlimmste.',476,0,0,'2022-06-04 08:11:37'),
(63,1,7,1,'Wenn du dich jemals in einer Notsituation auf Leben und Tod befunden hast, wirst du wissen, dass es da kein Problem gab. Der Verstand hatte keine Zeit, mit der Situation herumzuspielen und ein Problem daraus zu machen. In einer wirklichen Notlage hält der Verstand an - du wirst vollkommen gegenwärtig im Jetzt und eine unendlich viel größere Kraft übernimmt die Führung. Deshalb gibt es so viele Berichte von ganz normalen Leuten, die plötzlich unglaublich mutig handeln konnten.',476,0,0,'2022-06-04 08:11:38'),
(64,1,3,1,'Wenn du wissen willst, wer du warst, dann schau, wer du bist. Wenn du wissen willst, wer du sein wirst, dann schau, was du tust.',474,0,0,'2022-06-04 08:11:38'),
(65,1,20,1,'Man braucht vor niemand Angst zu haben. Wenn man jemanden fürchtet, dann kommt es daher, daß man diesem Jemand Macht über sich eingeräumt hat. (Demian)',472,0,0,'2022-06-04 08:11:38'),
(66,1,5,1,'Der Tod des Egos wird der Beginn deines wahren Lebens sein.',467,0,0,'2022-06-04 08:11:38'),
(67,1,16,1,'Mit zwanzig Jahren hat jeder das Gesicht, das Gott ihm gegeben hat, mit vierzig das Gesicht, das ihm das Leben gegeben hat, und mit sechzig das Gesicht, das er verdient.',463,0,0,'2022-06-04 08:11:38'),
(68,1,20,1,'Leute mit Mut und Charakter sind den anderen Leuten immer sehr unheimlich.',442,0,0,'2022-06-04 08:11:39'),
(69,1,24,1,'Enttäuscht vom Affen, schuf Gott den Menschen. Danach verzichtete er auf weitere Experimente.',438,0,0,'2022-06-04 08:11:39'),
(70,1,11,1,'Das Leben aller Lebewesen, seien sie nun Menschen, Tiere oder andere, ist kostbar, und alle haben dasselbe Recht, glücklich zu sein. Alles, was unseren Planeten bevölkert, die Vögel und die wilden Tiere sind unsere Gefährten. Sie sind Teil unserer Welt, wir teilen sie mit ihnen.',430,0,0,'2022-06-04 08:11:39'),
(71,1,10,1,'Welch triste Epoche, in der es leichter ist, ein Atom zu zertrümmern als ein Vorurteil!',428,0,0,'2022-06-04 08:11:39'),
(72,1,11,1,'Denke daran, dass Schweigen manchmal die beste Antwort ist.',427,0,0,'2022-06-04 08:11:39'),
(73,1,25,1,'Das Problem dieser Welt ist, dass die intelligenten Menschen so voller Selbstzweifel und die Dummen so voller Selbstvertrauen sind.',424,0,0,'2022-06-04 08:11:39'),
(74,1,26,1,'Ich werde lieber für das gehasst, was ich bin, als für das geliebt zu werden, was ich nicht bin.',421,0,0,'2022-06-04 08:11:40'),
(75,1,10,1,'Persönlichkeiten werden nicht durch schöne Reden geformt, sondern durch Arbeit und eigene Leistung.',408,0,0,'2022-06-04 08:11:40'),
(76,1,27,1,'Es gibt nur eine Sache die größer ist als die Liebe zur Freiheit: Der Hass auf die Person, die sie dir weg nimmt.',407,0,0,'2022-06-04 08:11:40'),
(77,1,3,1,'Wer liebt, vollbringt selbst Unmögliches.',402,0,0,'2022-06-04 08:11:40'),
(78,1,11,1,'Jede schwierige Situation, die du jetzt meisterst, bleibt dir in der Zukunft erspart.',395,0,0,'2022-06-04 08:11:41'),
(79,1,16,1,'Tierschutz ist Erziehung zur Menschlichkeit.',390,0,0,'2022-06-04 08:11:41'),
(80,1,28,1,'Lasse nie zu, dass du jemandem begegnest, der nicht nach der Begegnung mit dir glücklicher ist.',389,0,0,'2022-06-04 08:11:41'),
(81,1,24,1,'Gib jedem Tag die Chance, der schönste deines Lebens zu werden.',386,0,0,'2022-06-04 08:11:41'),
(82,1,29,1,'Am schlimmsten ist die Einsamkeit zu zweit.',382,0,0,'2022-06-04 08:11:41'),
(83,1,16,1,'Viele Menschen wissen, dass sie unglücklich sind. Aber noch mehr Menschen wissen nicht, dass sie glücklich sind.',379,0,0,'2022-06-04 08:11:42'),
(84,1,10,1,'Am Anfang gehören alle Gedanken der Liebe. Später gehört dann alle Liebe den Gedanken.',377,0,0,'2022-06-04 08:11:42'),
(85,1,13,1,'Wir sind nicht das, was die Leute von uns erwarten, oder so wie sie sich uns wünschen. Wir sind, wer wir zu sein beschlossen haben. Den anderen die Schuld zu geben ist immer einfach. Damit kannst du dein ganzes Leben zubringen, aber letztlich bist du allein für deine Erfolge oder deine Niederlagen verantwortlich. (Aleph)',376,0,0,'2022-06-04 08:11:42'),
(86,1,30,1,'Wenn du kritisiert wirst, dann musst du irgend etwas richtig machen. Denn man greift nur denjenigen an, der den Ball hat.',373,0,0,'2022-06-04 08:11:42'),
(87,1,12,1,'Bedenke stets, daß alles vergänglich ist; dann wirst du im Glück nicht zu fröhlich und im Leid nicht zu traurig sein.',370,0,0,'2022-06-04 08:11:42'),
(88,1,11,1,'Respektiere dich selbst, respektiere andere und übernimm Verantwortung für das was du tust.',366,0,0,'2022-06-04 08:11:42'),
(89,1,14,1,'Üblicherweise steht hinter jedem Idiot eine großartige Frau.',362,0,0,'2022-06-04 08:11:43'),
(90,1,17,1,'Ich habe einen Traum, dass meine vier Kinder eines Tages in einer Nation leben werden, in der man sie nicht nach ihrer Hautfarbe, sondern nach ihrem Charakter beurteilen wird.',360,0,0,'2022-06-04 08:11:43'),
(91,1,26,1,'Niemand stirbt als Jungfrau... das Leben fickt uns alle.',360,0,0,'2022-06-04 08:11:43'),
(92,1,7,1,'Jeder, der mit seinem Verstand identifiziert ist statt mit seiner wahren Stärke, dem tieferen, im Sein verankerten Selbst, wird die Angst als ständigen Begleiter haben.',359,0,0,'2022-06-04 08:11:43'),
(93,1,17,1,'Wir müssen lernen, entweder als Brüder miteinander zu leben oder als Narren unterzugehen.',359,0,0,'2022-06-04 08:11:43'),
(94,1,5,1,'Trauer bringt Tiefe. Freude bringt Höhe. Trauer bringt Wurzeln. Freude bringt Äste. Freude ist wie ein Baum der sich dem Himmel entgegenstreckt und Trauer ist wie die Wurzeln die in das Erdinnere hineinwachsen. Beides wird benötigt - je höher ein Baum wächst, desto tiefer verwurzelt er sich in der der Erde. So wird die Balance aufrechterhalten.',358,0,0,'2022-06-04 08:11:44'),
(95,1,16,1,'Wir leben in einem gefährlichen Zeitalter. Der Mensch beherrscht die Natur, bevor er gelernt hat, sich selbst zu beherrschen.',354,0,0,'2022-06-04 08:11:44'),
(96,1,3,1,'Groll mit uns herumtragen ist wie das Greifen nach einem glühenden Stück Kohle in der Absicht, es nach jemandem zu werfen. Man verbrennt sich nur selbst dabei.',350,0,0,'2022-06-04 08:11:44'),
(97,1,8,1,'Binde zwei Vögel zusammen; sie werden nicht fliegen können obwohl sie nun vier Flügel haben.',349,0,0,'2022-06-04 08:11:44'),
(98,1,1,1,'Unser Leben ist das, wozu unser Denken es macht.',348,0,0,'2022-06-04 08:11:44'),
(99,1,31,1,'Jede kleine Ehrlichkeit ist besser als eine große Lüge.',345,0,0,'2022-06-04 08:11:45'),
(100,1,15,1,'Wenn du Feinde hast - gut. Das heißt, dass du dich für etwas eingesetzt hast.',345,0,0,'2022-06-04 08:11:45'),
(101,1,11,1,'Wenn Du mit lieben Freunden streitest, beziehe dich nur auf die aktuelle Situation - lass die Vergangenheit ruhen.',345,0,0,'2022-06-04 08:11:45'),
(102,1,32,1,'Von der Liebe zum Hass bedarf es sehr viel Zorn - vom Hass zur Liebe nur ein klein wenig Verstand.',342,0,0,'2022-06-04 08:11:45'),
(103,1,13,1,'Wenn du mutig genug bist, «Lebewohl» zu sagen, wird das Leben dich mit einem neuen «Hallo» belohnen.',336,0,0,'2022-06-04 08:11:45'),
(104,1,13,1,'Wenn du «ja» sagst, dann sei dir sicher, dass du nicht «nein» zu dir selbst sagst.',332,0,0,'2022-06-04 08:11:46'),
(105,1,5,1,'Mit jedem Atemzug atmest du das Leben ein und den Tod aus.',331,0,0,'2022-06-04 08:11:46'),
(106,1,11,1,'Denke daran, die beste Beziehung ist die, in der die Liebe für den anderen größer ist als das Verlangen nach dem anderen.',327,0,0,'2022-06-04 08:11:46'),
(107,1,11,1,'Leid adelt den Menschen. Nur wer Leid erträgt, wird Glück erfahren.',327,0,0,'2022-06-04 08:11:46'),
(108,1,10,1,'Ich spreche mit jedem gleich, egal ob es sich um den Müllmann oder den Präsident der Universität handelt.',324,0,0,'2022-06-04 08:11:46'),
(109,1,1,1,'Wie du am Ende deines Lebens wünschest gelebt zu haben, so kannst du jetzt schon leben.',321,0,0,'2022-06-04 08:11:47'),
