(229,1,25,1,'Manchmal steigt man morgens aus dem Bett und denkt sich, dass man es nicht schaffen wird, aber innerlich lacht man darüber und erinnert sich an die vielen Male, die man das schon gedacht hat.',163,0,0,'2022-06-04 08:12:11'),
(230,1,48,1,'Was nützt mein Herz, wenn deins nicht mitschlägt, mitgeht, mitlebt, mitleidet, mitbebt?',163,0,0,'2022-06-04 08:12:11'),
(231,1,28,1,'Das einzige, was die Armut beseitigen kann, ist miteinander zu teilen.',162,0,0,'2022-06-04 08:12:11'),
(232,1,41,1,'Die Bande, welche die Traurigkeit zwischen zwei Seelen knüpft, sind stärker als die Bande der Glückseligkeit. Und die Liebe, die mit Tränen besiegelt wird, bleibt ewig rein und schön.',162,0,0,'2022-06-04 08:12:12'),
(233,1,40,1,'Je schöner und voller die Erinnerung, desto schwerer ist die Trennung. Aber die Dankbarkeit verwandelt die Erinnerung in eine stille Freude. Man trägt das vergangene Schöne nicht wie einen Stachel, sondern wie ein kostbares Geschenk in sich.',162,0,0,'2022-06-04 08:12:12'),
(234,1,11,1,'Die Liebe und das Mitgefühl sind die Grundlagen für den Weltfrieden - auf allen Ebenen.',161,0,0,'2022-06-04 08:12:12'),
(235,1,12,1,'Ängstigt euch nicht vor dem Tod, denn seine Bitterkeit liegt in der Furcht vor ihm.',160,0,0,'2022-06-04 08:12:12'),
(236,1,16,1,'Das Wissen hat Grenzen, das Denken nicht!',160,0,0,'2022-06-04 08:12:12'),
(237,1,2,1,'Wer klug ist, wird im Gespräch weniger an das denken, worüber er spricht, als an den, mit dem er spricht. Sobald er dies tut, ist er sicher, nichts zu sagen, das er nachher bereut.',160,0,0,'2022-06-04 08:12:12'),
(238,1,10,1,'Wer sich nicht mehr wundern und in Ehrfurcht verlieren kann, ist seelisch bereits tot.',159,0,0,'2022-06-04 08:12:13'),
(239,1,32,1,'Liebe ist der am schwersten zu erreichende Bewusstseinszustand.',158,0,0,'2022-06-04 08:12:13'),
(240,1,49,1,'Willst du den Charakter eines Menschen erkennen, so gib ihm Macht.',158,0,0,'2022-06-04 08:12:13'),
(241,1,16,1,'Wir müssen uns hüten, denen, die wir lieben, Mangel an Vertrauen vorzuwerfen, wenn sie uns nicht jederzeit in alle Ecken ihres Herzens einblicken lassen.',157,0,0,'2022-06-04 08:12:13'),
(242,1,3,1,'Alle Menschen sind eins. Was sie unterscheidet, ist der Name, den man ihnen gibt.',156,0,0,'2022-06-04 08:12:13'),
(243,1,34,1,'Als ich jung war, waren alle meine Glieder gelenkig bis auf eins. Jetzt, wo ich alt bin, sind alle meine Glieder steif, bis auf eins.',156,0,0,'2022-06-04 08:12:14'),
(244,1,30,1,'Selbst wenn ich, Bruce Lee, eines Tages ohne Erfüllung meines Strebens sterben sollte - ich bedauere nichts. Ich tat, was ich tun wollte. Was ich tat, geschah mit Aufrichtigkeit und so gut ich es konnte. Viel mehr kann man vom Leben nicht erwarten.',156,0,0,'2022-06-04 08:12:14'),
(245,1,11,1,'Die Ironie will es so, dass wir dann, wenn wir das Objekt unserer Wünsche erlangt haben, immer noch nicht zufrieden sind. Auf diese Weise nimmt die Begierde nie ein Ende und ist eine ständige Quelle der Schwierigkeiten. Das einzige Gegenmittel ist die Genügsamkeit.',155,0,0,'2022-06-04 08:12:14'),
(246,1,10,1,'Holzhacken ist deshalb so beliebt, weil man bei dieser Tätigkeit den Erfolg sofort sieht.',153,0,0,'2022-06-04 08:12:14'),
(247,1,13,1,'Wenn jemand seinen Weg gefunden hat, darf er keine Angst haben. Er muss auch den Mut aufbringen, Fehler zu machen. (Brida)',153,0,0,'2022-06-04 08:12:15'),
(248,1,50,1,'Gras ist die Heilung einer Nation, Alkohol ist die Zerstörung.',152,0,0,'2022-06-04 08:12:15'),
(249,1,14,1,'Ich glaube an Gott, aber nicht als ein Ding, nicht als einen alten Mann im Himmel. Ich glaube, das was Menschen Gott nennen, ist etwas in uns allen. Ich glaube, dass das was Jesus und Mohammed und Buddha und der ganze Rest gesagt haben, wahr ist. Es wurde nur durch die Übersetzungen verfälscht.',152,0,0,'2022-06-04 08:12:15'),
(250,1,17,1,'Liebe ist die beständigste Macht der Welt.',152,0,0,'2022-06-04 08:12:15'),
(251,1,25,1,'Manche Menschen sind nie verrückt. Was für ein wahrhaft grauenvolles Leben!',152,0,0,'2022-06-04 08:12:15'),
(252,1,17,1,'Vergebung ist keine einmalige Sache, Vergebung ist ein Lebensstil.',149,0,0,'2022-06-04 08:12:15'),
(253,1,11,1,'Ich versuche, allen Menschen gegenüber aufrichtig zu sein, selbst den Chinesen gegenüber. Wenn ich Feindseligkeit, Zorn oder Hass entwickle, wer ist dann der Leidtragende? Ich verliere meine Zufriedenheit, meinen Schlaf und meinen Appetit, aber die Chinesen stören meine Gefühle nicht im geringsten.',148,0,0,'2022-06-04 08:12:16'),
(254,1,34,1,'Man kann die Erfahrung nicht früh genug machen, wie entbehrlich man in der Welt ist.',148,0,0,'2022-06-04 08:12:16'),
(255,1,27,1,'Um etwas zu tun, muss man es sehr lieben. Um etwas sehr zu lieben, muss man bis zur Verrücktheit daran glauben.',148,0,0,'2022-06-04 08:12:16'),
(256,1,31,1,'Wo viel Gefühl ist, ist auch viel Leid.',148,0,0,'2022-06-04 08:12:16'),
(257,1,12,1,'…dieser glaubt doch, etwas zu wissen, was er nicht weiß, ich aber, der ich nichts weiß, glaube auch nicht zu wissen. Ich scheine doch wenigstens um ein Kleines weiser zu sein als dieser, weil ich, was ich nicht weiß, auch nicht zu wissen glaube…',148,0,0,'2022-06-04 08:12:17'),
(258,1,37,1,'Der Buddha sagte: Wenn ein weiser Mensch leidet, so fragt er sich «Was habe ich bisher getan, um mich von meinem Leiden zu befreien? Was kann ich noch tun, um es zu überwinden?» Wenn aber ein törichter Mensch leidet, so fragt er: «Wer hat mir das angetan?»',147,0,0,'2022-06-04 08:12:17'),
(259,1,11,1,'In der heutigen materialistischen Welt besteht die Gefahr, dass Menschen zu Sklaven des Geldes werden, als seien sie einfache Rädchen in einer riesigen Gelddruckmaschine. Dies hat nichts mit Menschenwürde, Freiheit oder echtem Wohlbefinden gemein. Der Besitz sollte der Menschheit dienen, nicht anders herum.',147,0,0,'2022-06-04 08:12:17'),
(260,1,14,1,'Stell dir vor, dass alle Menschen ihr Leben in Frieden leben. Du wirst sagen ich bin ein Träumer, aber ich bin nicht der Einzige. Ich hoffe, dass du dich uns eines Tages anschließt und die Welt wird Eins sein.',147,0,0,'2022-06-04 08:12:17'),
(261,1,51,1,'Wer so tut, als bringe er die Menschen zum Nachdenken, den lieben sie. Wer sie wirklich zum Nachdenken bringt, den hassen sie.',147,0,0,'2022-06-04 08:12:17'),
(262,1,29,1,'Dass man lebt, ist Zufall; dass man stirbt, ist gewiss.',145,0,0,'2022-06-04 08:12:17'),
(263,1,30,1,'Der Mensch ist dazu geboren, Großes zu leisten, wenn er versteht, sich selbst zu besiegen.',145,0,0,'2022-06-04 08:12:18'),
(264,1,1,1,'Die Fähigkeit, glücklich zu leben, kommt aus einer Kraft, die der Seele innewohnt.',144,0,0,'2022-06-04 08:12:18'),
(265,1,13,1,'Wenn du etwas ganz fest willst, dann wird das Universum darauf hinwirken, daß du es erreichen kannst. (Der Alchimist)',144,0,0,'2022-06-04 08:12:18'),
(266,1,8,1,'Jenseits von richtig und falsch gibt es einen Ort. Hier können wir einander begegnen.',143,0,0,'2022-06-04 08:12:18'),
(267,1,29,1,'An allem Unfug, der passiert, sind nicht etwa nur die schuld, die ihn tun, sondern auch die, die ihn nicht verhindern.',142,0,0,'2022-06-04 08:12:18'),
(268,1,11,1,'Wir leben nicht, um zu glauben, sondern um zu lernen.',142,0,0,'2022-06-04 08:12:19'),
(269,1,32,1,'Die Dampfmaschine war das Beste was dem Pferd passieren konnte.',141,0,0,'2022-06-04 08:12:19'),
(270,1,17,1,'Wir müssen begrenzte Fehlschläge akzeptieren, aber wir dürfen niemals die grenzenlose Hoffnung verlieren.',141,0,0,'2022-06-04 08:12:19'),
(271,1,12,1,'Eine Frau, gleichgestellt, wird überlegen.',140,0,0,'2022-06-04 08:12:19'),
(272,1,3,1,'Alles ist vergänglich und deshalb leidvoll.',139,0,0,'2022-06-04 08:12:19'),
(273,1,13,1,'Denn alle Menschen haben immer genaue Vorstellungen davon, wie wir unser Leben am besten zu leben haben. Doch nie wissen sie selber, wie sie ihr eigenes Leben am besten anpacken sollen. (Der Alchimist)',139,0,0,'2022-06-04 08:12:20'),
(274,1,3,1,'Ein wissender Mensch kann nicht glauben, daß Glück und Leid ohne Ursachen entstehen können.',139,0,0,'2022-06-04 08:12:20'),
(275,1,19,1,'Ich komme eigentlich nie zu spät - die anderen haben es bloß immer so eilig.',139,0,0,'2022-06-04 08:12:20'),
(276,1,11,1,'Besuche einmal im Jahr einen Ort, den du noch nicht kennst.',138,0,0,'2022-06-04 08:12:20'),
(277,1,27,1,'Wissen macht uns verantwortlich.',138,0,0,'2022-06-04 08:12:21'),
(278,1,12,1,'Bedenke, daß die menschlichen Verhältnisse insgesamt unbeständig sind, dann wirst du im Glück nicht zu fröhlich und im Unglück nicht zu traurig sein.',137,0,0,'2022-06-04 08:12:21'),
(279,1,25,1,'Das Leben ist eine Illusion, hervorgerufen durch Alkoholmangel.',137,0,0,'2022-06-04 08:12:21'),
(280,1,12,1,'Eigenartigerweise kann ein Mann immer sagen, wie viele Schafe er besitzt, aber er kann nicht sagen, wie viele Freunde er hat, so gering ist der Wert, den wir ihnen beimessen.',137,0,0,'2022-06-04 08:12:21'),
(281,1,39,1,'Ich brauche nur das zu tun, was ich will, und nicht, was die anderen von mir erwarten. In der Gemeinschaft ist es leicht, nach fremden Vorstellungen zu leben. In der Einsamkeit ist es leicht, nach eigenen Vorstellungen zu leben – aber bewundernswert ist nur der, der sich in der Gemeinschaft die Unabhängigkeit bewahrt.',137,0,0,'2022-06-04 08:12:21'),
(282,1,37,1,'Menschen dabei behilflich zu sein, nicht von Ängsten zerstört zu werden, ist das größte Geschenk überhaupt.',137,0,0,'2022-06-04 08:12:22'),
(283,1,34,1,'Wer nicht mehr liebt und nicht mehr irrt, der lasse sich begraben.',137,0,0,'2022-06-04 08:12:22'),
(284,1,3,1,'Unsere Verabredung mit dem Leben findet im gegenwärtigen Augenblick statt. Und der Treffpunkt ist genau da, wo wir uns gerade befinden.',136,0,0,'2022-06-04 08:12:22'),
(285,1,26,1,'Wenn du stirbst, bist du vollkommen glücklich und deine Seele lebt irgendwo weiter. Ich habe keine Angst zu sterben. Vollkommener Frieden nach dem Tod, jemand anderes zu werden ist die beste Hoffnung, die ich habe.',136,0,0,'2022-06-04 08:12:22'),
(286,1,36,1,'Neue Wege entstehen, indem wir sie gehen.',135,0,0,'2022-06-04 08:12:22'),
(287,1,52,1,'Wer kämpft, kann verlieren. Wer nicht kämpft, hat schon verloren.',135,0,0,'2022-06-04 08:12:23'),
(288,1,20,1,'Jeder Mensch ist liebenswert, wenn er wirklich zu Worte kommt.',134,0,0,'2022-06-04 08:12:23'),
(289,1,26,1,'Jemand anderes sein zu wollen, ist eine Verschwendung deiner eigenen Person.',134,0,0,'2022-06-04 08:12:23'),
(290,1,20,1,'Wahrlich, keiner ist weise, der nicht das Dunkel kennt.',134,0,0,'2022-06-04 08:12:23'),
(291,1,22,1,'Alle unsere Streitereien entstehen daraus, daß einer dem anderen seine Meinung aufzwingen will.',133,0,0,'2022-06-04 08:12:23'),
(292,1,35,1,'Die Menschen sollten weniger übereinander reden, sondern miteinander sprechen.',133,0,0,'2022-06-04 08:12:24'),
(293,1,30,1,'Nimm die Dinge, wie sie sind: Schlage, wenn du schlagen musst. Tritt, wenn du treten musst.',133,0,0,'2022-06-04 08:12:24'),
(294,1,10,1,'Die Naturwissenschaft ohne Religion ist lahm, die Religion ohne Naturwissenschaft ist blind.',132,0,0,'2022-06-04 08:12:24'),
(295,1,53,1,'Vielleicht gibt es schönere Zeiten; aber diese ist die unsere.',132,0,0,'2022-06-04 08:12:24'),
(296,1,24,1,'Wenn du einen verhungernden Hund aufliest und machst ihn satt, dann wird er dich nicht beissen. Das ist der Grundunterschied zwischen Hund und Mensch.',132,0,0,'2022-06-04 08:12:24'),
(297,1,25,1,'Wir werden alle sterben, jeder von uns, was für ein Zirkus! Das alleine sollte uns dazu bringen, uns zu lieben, aber das tut es nicht. Wir werden terrorisiert von Kleinigkeiten, zerfressen von gar nichts.',132,0,0,'2022-06-04 08:12:24'),
(298,1,19,1,'Neid ist der Schatten, den der Erfolg wirft.',131,0,0,'2022-06-04 08:12:25'),
(299,1,10,1,'Zwei Dinge sind zu unserer Arbeit nötig: Unermüdliche Ausdauer und die Bereitschaft, etwas, in das man viel Zeit und Arbeit gesteckt hat, wieder wegzuwerfen.',131,0,0,'2022-06-04 08:12:25'),
(300,1,3,1,'Das beste Gebet ist Geduld.',130,0,0,'2022-06-04 08:12:25'),
(301,1,10,1,'Das, wobei unsere Berechnungen versagen, nennen wir Zufall.',130,0,0,'2022-06-04 08:12:25'),
(302,1,20,1,'Solange du nach dem Glück jagst, bist du nicht reif zum Glücklichsein.',130,0,0,'2022-06-04 08:12:26'),
(303,1,1,1,'Verzweiflung befällt zwangsläufig die, deren Seele aus dem Gleichgewicht ist.',130,0,0,'2022-06-04 08:12:26'),
(304,1,29,1,'Die Lust an der Macht hat ihren Ursprung nicht in der Stärke, sondern in der Schwäche.',129,0,0,'2022-06-04 08:12:26'),
(305,1,52,1,'Liebe ist der Wunsch etwas zu geben, nicht etwas zu erhalten.',129,0,0,'2022-06-04 08:12:26'),
(306,1,7,1,'Wenn du deine Aufmerksamkeit so viel wie möglich im Körper hältst, dann bist du im Jetzt verankert. Du verlierst dich weder in der äußeren Welt noch in deinem Verstand. Gedanken und Gefühle, Ängste und Wünsche können dann zwar noch da sein, aber sie überwältigen dich nicht.',129,0,0,'2022-06-04 08:12:26'),
(307,1,29,1,'Dass wir wieder werden wie Kinder, ist eine unerfüllbare Forderung. Aber wir können zu verhüten versuchen, dass die Kinder so werden wie wir.',128,0,0,'2022-06-04 08:12:27'),
(308,1,41,1,'Die Natur reicht uns die Hand der Freundschaft, sie lädt uns ein, damit wir uns an ihrer Schönheit erfreuen; doch wir fürchten ihre Stille und fliehen in die Städte, wo wir uns zusammendrängen wie eine Herde Lämmer beim Anblick des Wolfes.',128,0,0,'2022-06-04 08:12:27'),
(309,1,27,1,'Es macht mir nichts aus, wenn ich falle; solange jemand anderes mein Gewehr aufhebt und weiterschießt.',128,0,0,'2022-06-04 08:12:27'),
(310,1,38,1,'Glaube ohne Liebe ist nichts wert.',128,0,0,'2022-06-04 08:12:27'),
(311,1,40,1,'Herr, in mir ist es finster, aber bei dir ist das Licht. Ich bin einsam, aber du verlässt mich nicht. Ich bin kleinmütig, aber bei dir ist Hilfe. Ich bin unruhig, aber bei dir ist der Friede. Ich verstehe deine Wege nicht, aber du weisst den Weg für mich.',128,0,0,'2022-06-04 08:12:27'),
(312,1,15,1,'Ich habe mir das schon immer gewünscht, aber es wird fast mehr zu einem Albtraum als zu einem Traum.',128,0,0,'2022-06-04 08:12:28'),
(313,1,32,1,'Leben ist das instabilste Konstrukt gebundener Materie.',128,0,0,'2022-06-04 08:12:28'),
(314,1,10,1,'Das Geld zieht nur den Eigennutz an und verführt stets unwiderstehlich zum Mißbrauch.',127,0,0,'2022-06-04 08:12:28'),
(315,1,30,1,'Ich werde nie behaupten, dass ich die Nummer 1 bin, doch ich werde auch nie zugeben, Nummer 2 zu sein.',127,0,0,'2022-06-04 08:12:28'),
(316,1,3,1,'Ihr selbst müßt euch Mühe geben, die Erwachsenen weisen nur den Weg.',127,0,0,'2022-06-04 08:12:28'),
(317,1,41,1,'Bäume sind Gedichte, die die Erde in den Himmel schreibt. Wir fällen sie und verwandeln sie in Papier, um unsere Leere darauf auszudrücken.',126,0,0,'2022-06-04 08:12:28'),
(318,1,7,1,'Der Verstand an sich ist nicht gestört. Er ist ein wunderbares Werkzeug. Die Störung beginnt, wenn du dein Selbst in ihm suchst und ihn fälschlicherweise für das hälst, was du bist. Dann wird er zum Ego-Verstand und übernimmt die Macht über dein ganzes Leben.',126,0,0,'2022-06-04 08:12:29'),
(319,1,5,1,'Die Frage ist nicht, ob es ein Leben nach dem Tod gibt. Die Frage ist, ob du vor dem Tod lebendig bist.',126,0,0,'2022-06-04 08:12:29'),
(320,1,44,1,'Du kannst mehr über eine Person lernen, indem du darauf achtest, wie sie über andere spricht, als wenn du darauf achtest, wie andere über sie sprechen.',126,0,0,'2022-06-04 08:12:29'),
(321,1,29,1,'Jedes Lächeln, das du aussendest, kehrt doppelt zu dir zurück.',126,0,0,'2022-06-04 08:12:29'),
(322,1,14,1,'Du brauchst niemanden, der dir sagt wer oder was du bist. Du bist was du bist!',125,0,0,'2022-06-04 08:12:30'),
(323,1,35,1,'Mit Geld kann man seine Lage verbessern; aber nicht seinen Charakter.',125,0,0,'2022-06-04 08:12:30'),
(324,1,13,1,'Tief empfundene Sehnsucht, echte Sehnsucht ist die Sehnsucht, jemandem nah zu sein.',125,0,0,'2022-06-04 08:12:30'),
(325,1,11,1,'Die Übung in Geduld bewahrt uns vor dem Verlust unserer Gelassenheit. Dadurch haben wir die Möglichkeit unser Urteilsvermögen zu trainieren, selbst in sehr schwierigen Situationen. Es gibt uns inneren Raum. Und durch diesen Raum gewinnen wir ein gewisses Maß an Selbstbeherrschung, welche uns erlaubt auf Situationen in angemessener Weise reagieren zu können. Mitfühlend, anstatt durch unsere Wut und Verärgerung getrieben.',124,0,0,'2022-06-04 08:12:30'),
(326,1,21,1,'Der Narr hält sich für weise, aber der Weise weiß, daß er ein Narr ist.',123,0,0,'2022-06-04 08:12:30'),
(327,1,29,1,'Wer wagt es, sich den donnernden Zügen entgegenzustellen? Die kleinen Blumen zwischen den Eisenbahnschwellen.',123,0,0,'2022-06-04 08:12:30'),
(328,1,53,1,'Der sensible Mensch leidet nicht aus diesem oder jenem Grunde, sondern ganz allein, weil nichts auf dieser Welt seine Sehnsucht stillen kann.',122,0,0,'2022-06-04 08:12:31'),
(329,1,12,1,'Wer nichts weiß und weiß nicht, daß er nichts weiß, ist ein Tor – meide ihn. Wer nichts weiß und weiß, daß er nichts weiß, ist bescheiden – belehre ihn. Wer etwas weiß und weiß nicht, daß er etwas weiß, ist im Schlafe – wecke ihn. Wer etwas weiß und weiß, daß er etwas weiß, ist weise – folge ihm.',122,0,0,'2022-06-04 08:12:31'),
(330,1,54,1,'Als ich mich wirklich selbst zu lieben begann, habe ich mich von allem befreit was nicht gesund für mich war, von Speisen, Menschen, Dingen, Situationen und von allem, das mich immer wieder hinunterzog, weg von mir selbst. Anfangs nannte ich das “gesunden Egoismus”, aber heute weiß ich, das ist “Selbstliebe”.',121,0,0,'2022-06-04 08:12:31'),
(331,1,5,1,'Ein weiser Mensch lässt die Vergangenheit jeden Augenblick los und geht wie neugeboren in die Zukunft. Für Ihn ist die Gegenwart eine ständige Transformation, eine Wiedergeburt, eine Auferstehung.',121,0,0,'2022-06-04 08:12:31'),
(332,1,25,1,'Man muss erst einige Male sterben um wirklich leben zu können.',121,0,0,'2022-06-04 08:12:32'),
(333,1,2,1,'Was nun andrerseits die Menschen gesellig macht, ist ihre Unfähigkeit, die Einsamkeit und in dieser sich selbst zu ertragen.',121,0,0,'2022-06-04 08:12:32'),
(334,1,38,1,'Wenn du ein Kind siehst, hast du Gott auf frischer Tat ertappt.',121,0,0,'2022-06-04 08:12:32'),
(335,1,34,1,'Im Deutschen lügt man, wenn man höflich ist.',120,0,0,'2022-06-04 08:12:32'),
(336,1,6,1,'Vertraue deinem Herzen. Wertschätze dessen Intuition. Wähle die Angst loszulassen und öffne dich der Wahrheit und du wirst erwachen zu Freiheit, Klarheit und Freude am Sein.',120,0,0,'2022-06-04 08:12:32'),
(337,1,10,1,'Wozu Socken? Sie schaffen nur Löcher!',120,0,0,'2022-06-04 08:12:32'),
(338,1,55,1,'Das, was du bist, zeigt sich an dem, was du tust.',119,0,0,'2022-06-04 08:12:33'),
(339,1,8,1,'Du hast eine Aufgabe zu erfüllen. Du magst tun was du willst, magst hunderte von Plänen verwirklichen, magst ohne Unterbrechung tätig sein – wenn du aber diese eine Aufgabe nicht erfüllst, wird alle deine Zeit vergeudet sein.',119,0,0,'2022-06-04 08:12:33'),
(340,1,34,1,'Es hört doch jeder nur, was er versteht.',119,0,0,'2022-06-04 08:12:33'),
(341,1,38,1,'Glaube nicht alles, was Du hörst, sage nicht alles, was Du willst, tue nicht alles, was Du magst.',119,0,0,'2022-06-04 08:12:33'),
(342,1,3,1,'Lob und Tadel bringen den Weisen nicht aus dem Gleichgewicht.',119,0,0,'2022-06-04 08:12:34'),
(343,1,56,1,'Man braucht zwei Jahre, um sprechen zu lernen, fünfzig, um schweigen zu lernen.',119,0,0,'2022-06-04 08:12:34'),
(344,1,10,1,'Wenn ich die Folgen geahnt hätte, wäre ich Uhrmacher geworden.',119,0,0,'2022-06-04 08:12:34'),
(345,1,47,1,'Wer sich selbst auf den Arm nimmt, erspart anderen die Arbeit.',119,0,0,'2022-06-04 08:12:34'),
(346,1,32,1,'So edel und ehrlich die Liebe auch ist, so bleibt sie dennoch Lebensgefährlich.',118,0,0,'2022-06-04 08:12:34'),
(347,1,1,1,'Wir müssen von ganzem Herzen alles, was uns trifft, willkommen heißen, wir dürfen auch innerlich nicht murren, ja uns nicht einmal wundern.',118,0,0,'2022-06-04 08:12:34'),
