(586,1,35,1,'Kriege sind der Beweis menschlicher Dummheit.',68,0,0,'2022-06-04 08:13:22'),
(587,1,47,1,'Man macht gewöhnlich viele Worte, wenn man nichts zu sagen hat.',68,0,0,'2022-06-04 08:13:23'),
(588,1,33,1,'Setze dich deiner tiefsten Angst aus. Danach hat die Angst keine Macht mehr über dich und die Angst vor Freiheit schrumpft und verschwindet. Du bist frei.',68,0,0,'2022-06-04 08:13:23'),
(589,1,24,1,'Tiere sind die besten Freunde. Sie stellen keine Fragen und kritisieren nicht.',68,0,0,'2022-06-04 08:13:23'),
(590,1,30,1,'Wahrheit ist lebendig und daher ständig wechselnd.',68,0,0,'2022-06-04 08:13:23'),
(591,1,7,1,'Wie hört man auf, Zeit zu erschaffen? Erkenne zutiefst, dass dein ganzes Leben sich im gegenwärtigen Moment abspielt. Stelle das Jetzt ins Zentrum deines Lebens. Während du vorher in der Zeit gelebt und dem Jetzt nur kurze Besuche abgestattet hast, verbleibe von nun an im Jetzt und statte der Vergangenheit und Zukunft kurze Besuche ab, wenn das nötig ist, um mit den praktischen Aspekten deiner Lebenssituation umzugehen.',68,0,0,'2022-06-04 08:13:23'),
(592,1,11,1,'Der eigentliche Sinn unseres Lebens besteht im Streben nach Glück. An welche Religion ein Mensch auch glaubt, er sucht nach etwas besserem im Leben. Ich glaube das Glück durch Schulung des Geistes erlangt werden kann.',67,0,0,'2022-06-04 08:13:24'),
(593,1,13,1,'Die Entscheidungen waren nur der Anfang von etwas. Wenn man einen Entschluss gefasst hatte, dann tauchte man damit in eine gewaltige Strömung, die einen mit sich riss, zu einem Ort, den man sich bei dem Entschluss niemals hätte träumen lassen. (Der Alchimist)',67,0,0,'2022-06-04 08:13:24'),
(594,1,24,1,'Erziehung ist die organisierte Verteidigung der Erwachsenen gegen die Jugend.',67,0,0,'2022-06-04 08:13:24'),
(595,1,53,1,'Es gibt eine Menge Leute auf der Welt, die in der Hölle sind, weil sie zu sehr vom Urteil anderer abhängen.',67,0,0,'2022-06-04 08:13:24'),
(596,1,30,1,'Wenn Sie das Leben lieben, dann gilt es keine Zeit zu verschwenden, denn aus Zeit besteht das Leben.',67,0,0,'2022-06-04 08:13:25'),
(597,1,5,1,'Das Leben ist nichts weiter als eine Möglichkeit, Liebe erblühen zu lassen.',66,0,0,'2022-06-04 08:13:25'),
(598,1,24,1,'Der beste Weg, sich selbst eine Freude zu machen, ist: zu versuchen, einem andern eine Freude zu bereiten.',66,0,0,'2022-06-04 08:13:25'),
(599,1,53,1,'Die Jugend will, daß man ihr befiehlt, damit sie die Möglichkeit hat, nicht zu gehorchen.',66,0,0,'2022-06-04 08:13:25'),
(600,1,49,1,'Halte dir jeden Tag dreißig Minuten für deine Sorgen frei, und in dieser Zeit mache ein Nickerchen.',66,0,0,'2022-06-04 08:13:25'),
(601,1,1,1,'Manche Leute verstehen unter Verschwiegenheit, dass sie die ihnen anvertrauten Geheimnisse nur hinter vorgehaltener Hand weitererzählen.',66,0,0,'2022-06-04 08:13:26'),
(602,1,46,1,'Einen Menschen lieben, heißt einzuwilligen, mit ihm alt zu werden.',65,0,0,'2022-06-04 08:13:26'),
(603,1,56,1,'Glück, das ist einfach eine gute Gesundheit und ein schlechtes Gedächtnis.',65,0,0,'2022-06-04 08:13:26'),
(604,1,33,1,'Hass ist eine sehr unterschätzte Emotion.',65,0,0,'2022-06-04 08:13:26'),
(605,1,7,1,'Innerer Widerstand schneidet dich von anderen Menschen, von dir selbst, von der Welt um dich herum ab. Er verstärkt das Gefühl der Getrenntheit, von dem das Überleben des Ego abhängt. Je stärker dein Gefühl der Getrenntheit, desto mehr bist du an das Manifeste gebunden, an die Welt der Form.',65,0,0,'2022-06-04 08:13:26'),
(606,1,47,1,'Lieber ein kleiner Lackschaden, als ein großer Dachschaden.',65,0,0,'2022-06-04 08:13:27'),
(607,1,12,1,'Rede, damit ich dich sehe.',65,0,0,'2022-06-04 08:13:27'),
(608,1,34,1,'Wenn du eine weise Antwort verlangst, mußt du vernünftig fragen.',65,0,0,'2022-06-04 08:13:27'),
(609,1,29,1,'Alles, was gigantische Formen annimmt, kann imponieren - auch die Dummheit.',64,0,0,'2022-06-04 08:13:27'),
(610,1,25,1,'Das ganze Leben bestand doch schon aus Warten. Warten aufs Leben, warten aufs Sterben.',64,0,0,'2022-06-04 08:13:27'),
(611,1,11,1,'Der erste Nachteil von Zorn ist, dass er deinen inneren Frieden zerstört. Der Zweite ist, dass er deine Sicht auf die Wirklichkeit verzerrt. Wenn du darüber nachdenkst, wirst du verstehen, dass Zorn und Wut uns nicht weiterhilft, sondern nur destruktiv auf uns wirkt. Somit können wir beginnen, uns von Wut und Zorn zu distanzieren, sollten diese Gefühle in uns aufkommen.',64,0,0,'2022-06-04 08:13:27'),
(612,1,9,1,'Der Neid ist die aufrichtigste Form der Anerkennung.',64,0,0,'2022-06-04 08:13:28'),
(613,1,31,1,'Die Mitteilungsmöglichkeit des Menschen ist gewaltig, doch das meiste, was er sagt, ist hohl und falsch.',64,0,0,'2022-06-04 08:13:28'),
(614,1,16,1,'Die Wahrheit hat keine Stunde. Ihre Zeit ist immer und gerade dann, wenn sie am unzeitgemäßesten scheint.',64,0,0,'2022-06-04 08:13:28'),
(615,1,47,1,'Eine Frau, die vor ihrem Mann keine Geheimnisse hat, hat entweder keine Geheimnisse oder keinen Mann.',64,0,0,'2022-06-04 08:13:28'),
(616,1,30,1,'Eine wahrhafte Anstrengung in die Richtung eines bestimmten Zieles, gibt dem Leben Sinn und Zweck.',64,0,0,'2022-06-04 08:13:28'),
(617,1,3,1,'Fehlt der Eifer, schwindet die Weisheit.',64,0,0,'2022-06-04 08:13:29'),
(618,1,12,1,'König ist nur, wer seine eigenen Leidenschaften beherrscht.',64,0,0,'2022-06-04 08:13:29'),
(619,1,47,1,'Manche Frauen sind wie Löschpapier; Sie nehmen alles in sich auf und geben es anschließend verkehrt wieder.',64,0,0,'2022-06-04 08:13:29'),
(620,1,16,1,'Von dem, was unser innerliches Erleben ausmacht, können wir auch unsern Vertrautesten nur Bruchstücke mitteilen.',64,0,0,'2022-06-04 08:13:29'),
(621,1,43,1,'Es ist doch erstaunlich, was ein einziger Sonnenstrahl mit der Seele des Menschen machen kann.',63,0,0,'2022-06-04 08:13:29'),
(622,1,42,1,'Es ist sonderbar, aber Eltern sind auch Menschen, und sie sind, was die Herstellung und Aufzucht von Nachwuchs betrifft, so was wie ungelernte Arbeiter.',63,0,0,'2022-06-04 08:13:30'),
(623,1,64,1,'Freundschaft ist eine Seele in zwei Körpern.',63,0,0,'2022-06-04 08:13:30'),
(624,1,3,1,'Güte ist durch die Erkenntnis von den Schlacken der Leidenschaft geläuterte Liebe.',63,0,0,'2022-06-04 08:13:30'),
(625,1,3,1,'Hat jemand Einsicht gewonnen und gepflegt, hat der Tod nicht Gewalt über ihn.',63,0,0,'2022-06-04 08:13:30'),
(626,1,17,1,'Kein Problem wird gelöst, wenn wir träge darauf warten, dass Gott allein sich darum kümmert.',63,0,0,'2022-06-04 08:13:30'),
(627,1,22,1,'Mißtrauen ist ein Zeichen von Schwäche.',63,0,0,'2022-06-04 08:13:31'),
(628,1,11,1,'Versuchen wir, das Beste eines jeden Menschen zu erkennen, den anderen im bestmöglichen Licht zu sehen. Diese Einstellung erzeugt sofort ein Gefühl der Nähe, eine Art Geneigtheit, eine Verbindung.',63,0,0,'2022-06-04 08:13:31'),
(629,1,11,1,'Wenn der Wunsch nach Glück ausreichte, um es herbeizuführen, gäbe es keine Leiden, denn niemand sucht das Leid.',63,0,0,'2022-06-04 08:13:31'),
(630,1,19,1,'Wenn ich immer alle Regeln befolgt hätte, hätte ich es nie zu etwas gebracht.',63,0,0,'2022-06-04 08:13:31'),
(631,1,39,1,'Wirf deine Angst ab, verlaß dich auf deine inneren Hilfsquellen, vertraue dem Leben, und es wird dir\'s vergelten. Du vermagst mehr als du denkst.',63,0,0,'2022-06-04 08:13:32'),
(632,1,66,1,'Alles was uns an anderen mißfällt, kann uns zu besserer Selbsterkenntnis führen.',62,0,0,'2022-06-04 08:13:32'),
(633,1,6,1,'Das Ego ist ein Geist der Angst hat zu sterben.',62,0,0,'2022-06-04 08:13:32'),
(634,1,3,1,'Denn Willen nenne ich das Wirken, denn ist der Wille da, so wirkt man, sei es in Werken, Worten oder Gedanken.',62,0,0,'2022-06-04 08:13:32'),
(635,1,30,1,'Der Mensch als kreatives Individium ist viel wichtiger als irgendein Stil oder System.',62,0,0,'2022-06-04 08:13:32'),
(636,1,13,1,'Es ist gut, etwas Langsames zu tun, bevor man im Leben eine wichtige Entscheidung trifft.',62,0,0,'2022-06-04 08:13:32'),
(637,1,37,1,'Ihr solltet Meditation üben beim Gehen, Stehen, Liegen, Sitzen und Arbeiten, beim Händewaschen, Abspülen, Kehren und Teetrinken, im Gespräch mit Freunden und bei allem, was ihr tut. Wenn ihr abwascht, denkt ihr vielleicht an den Tee danach und versucht, es so schnell wie möglich hinter euch zu bringen, damit ihr euch setzen und Tee trinken könnt. Das bedeutet aber, daß ihr in der Zeit, wo ihr abwascht, nicht lebt. Wenn ihr abwascht, muß der Abwasch das Wichtigste in eurem Leben sein. Und wenn ihr Tee trinkt, dann muß das Teetrinken das Wichtigste auf der Welt sein.',62,0,0,'2022-06-04 08:13:33'),
(638,1,30,1,'Kein Weg als Weg, keine Grenze als Grenze.',62,0,0,'2022-06-04 08:13:33'),
(639,1,13,1,'Lerne, dass Siege wie Niederlagen zum Leben eines jeden gehören - außer zum Leben der Feiglinge.',62,0,0,'2022-06-04 08:13:33'),
(640,1,20,1,'Nur das Denken, das wir leben, hat einen Wert.',62,0,0,'2022-06-04 08:13:33'),
(641,1,1,1,'Oft tut auch der Unrecht, der nichts tut. Wer das Unrecht nicht verbietet, wenn er kann, der befiehlt es!',62,0,0,'2022-06-04 08:13:34'),
(642,1,12,1,'Was du auch tust, du wirst es bereuen.',62,0,0,'2022-06-04 08:13:34'),
(643,1,32,1,'Das Universum ist ein einziges weibliches Ejakulat.',61,0,0,'2022-06-04 08:13:34'),
(644,1,43,1,'Die beste Definition des Menschen lautet wohl: undankbarer Zweibeiner.',61,0,0,'2022-06-04 08:13:34'),
(645,1,21,1,'Die Kraft eines Riesen zu besitzen ist wunderbar. Sie wie ein Riese zu gebrauchen ist Tyrannei.',61,0,0,'2022-06-04 08:13:34'),
(646,1,1,1,'Einsamkeit suchen die Menschen auf ländlichen Fluren, am Meeresufer, in den Bergen. Doch einer wie beschränkten Ansicht entspringt dieser Wunsch! Kannst du dich doch, sooft du nur willst, in dich selbst zurückziehen. Gibt es doch nirgends eine stillere und ungestörtere Zufluchtsstätte als die Menschenseele.',61,0,0,'2022-06-04 08:13:34'),
(647,1,7,1,'Frei von Zeit zu sein bedeutet, frei zu sein von dem psychologischen Bedürfnis nach Vergangenheit und Zukunft - nach Vergangenheit, weil sie dir eine Identität gibt, nach Zukunft, weil sie Erfüllung verspricht.',61,0,0,'2022-06-04 08:13:35'),
(648,1,47,1,'Frieden auf Erden - hoffentlich wird es keinen Zaun mehr geben, von dem man einen Streit brechen kann.',61,0,0,'2022-06-04 08:13:35'),
(649,1,7,1,'Je größer der zeitliche Abstand zwischen Wahrnehmung und Gedanke ist, desto mehr Tiefe besitzt du als menschliches Wesen und desto bewusster bist du.',61,0,0,'2022-06-04 08:13:35'),
(650,1,35,1,'Manche Leute reden sich Sorgen ein, die sie gar nicht haben.',61,0,0,'2022-06-04 08:13:35'),
(651,1,30,1,'Sie können es im Leben zu etwas bringen, wenn Sie bereit sind, alles dafür zu tun.',61,0,0,'2022-06-04 08:13:36'),
(652,1,29,1,'Wenn man genug Geld hat, stellt sich der gute Ruf ganz von selbst ein.',61,0,0,'2022-06-04 08:13:36'),
(653,1,12,1,'Zur Unterscheidung von Gutem und Schlechtem bedarf der Verständige keines anderen Menschen.',61,0,0,'2022-06-04 08:13:36'),
(654,1,18,1,'Alleinsein kann es erst geben, wenn die Einsamkeit aufgehört hat.',60,0,0,'2022-06-04 08:13:36'),
(655,1,58,1,'Am Rausch ist nicht der Wein schuld, sondern der Trinker.',60,0,0,'2022-06-04 08:13:36'),
(656,1,67,1,'Eine gute Rede soll das Thema erschöpfen, nicht die Zuhörer.',60,0,0,'2022-06-04 08:13:37'),
(657,1,68,1,'Es gibt nichts außerhalb von dir, dass dich dazu bemächtigt, stärker, reicher, schneller oder klüger zu werden. Alles ist in dir. Alles existiert. Suche nichts außerhalb von dir selbst.',60,0,0,'2022-06-04 08:13:37'),
(658,1,40,1,'Herr Jesus Christus! Du warst arm und elend, gefangen und verlassen wie ich. Du kennst die Not der Menschen. Du bleibst bei mir, wenn kein Mensch mir beisteht. Du vergisst mich nicht und suchst mich. Du willst, dass ich dich erkenne und mich zu dir kehre. Herr, ich höre deinen Ruf und folge. Hilf mir!',60,0,0,'2022-06-04 08:13:37'),
(659,1,11,1,'Ich finde Hoffnung in den dunkelsten Tagen, und fokussiere mich auf die hellsten. Ich verurteile das Universum nicht.',60,0,0,'2022-06-04 08:13:37'),
(660,1,61,1,'Kein Schmerz ist größer, als sich der Zeit des Glückes zu erinnern, wenn man im Elend ist.',60,0,0,'2022-06-04 08:13:37'),
(661,1,1,1,'Ein hervorragendes Mittel der Verteidigung: Sei deinem Angreifer nie ebenbürtig.',59,0,0,'2022-06-04 08:13:38'),
(662,1,29,1,'Ich glaube an den gesunden Menschenverstand wie an ein Wunder; doch der gesunde Menschenverstand verbietet mir, an Wunder zu glauben.',59,0,0,'2022-06-04 08:13:38'),
(663,1,34,1,'Lerne alt zu werden mit einem jungen Herzen.',59,0,0,'2022-06-04 08:13:38'),
(664,1,37,1,'Wenn wir nicht ganz wir selbst sind, wahrhaft im gegenwärtigen Augenblick, verpassen wir alles.',59,0,0,'2022-06-04 08:13:38'),
(665,1,35,1,'Wir besitzen die Welt; aber sie gehört uns nicht.',59,0,0,'2022-06-04 08:13:38'),
(666,1,6,1,'Die Welt zu verändern ist nicht dein Auftrag. Dich selbst zu ändern ist nicht deine Aufgabe. Zu deiner wahren Natur zu erwachen ist Deine Möglichkeit.',58,0,0,'2022-06-04 08:13:39'),
(667,1,19,1,'Freunde akzeptieren dich so, wie du bist.',58,0,0,'2022-06-04 08:13:39'),
(668,1,35,1,'Menschen, die nachtragen, haben viel zu schleppen.',58,0,0,'2022-06-04 08:13:39'),
(669,1,36,1,'Überzeugungen sind gefährlichere Feinde der Wahrheit als Lügen.',58,0,0,'2022-06-04 08:13:39'),
(670,1,35,1,'Wenn Worte schon Taten wären, würde es ziemlich still werden auf der Welt.',58,0,0,'2022-06-04 08:13:39'),
(671,1,32,1,'Ästhetik definiert sich auch dadurch, dass man sie in den grausamsten Dingen vorfindet.',57,0,0,'2022-06-04 08:13:40'),
