(673,1,2,1,'Das Geld gleicht dem Seewasser. Je mehr davon getrunken wird, desto durstiger wird man.',57,0,0,'2022-06-04 08:13:40'),
(674,1,35,1,'Der Text kommt von der Regierung, die Melodie vom Volk.',57,0,0,'2022-06-04 08:13:40'),
(675,1,30,1,'Der Traum von gestern ist die Wirklichkeit von heute und morgen.',57,0,0,'2022-06-04 08:13:41'),
(676,1,12,1,'Die Selbsterkenntnis gibt dem Menschen das meiste Gute, die Selbsttäuschung aber das meiste Übel.',57,0,0,'2022-06-04 08:13:41'),
(677,1,26,1,'Es ist besser auszubrennen als zu verblassen.',57,0,0,'2022-06-04 08:13:41'),
(678,1,21,1,'Freundschaft hält stand in allen Dingen, nur in der Liebe Dienst und Werbung nicht.',57,0,0,'2022-06-04 08:13:41'),
(679,1,58,1,'Indem man über andere schlecht redet, macht man sich selber nicht besser.',57,0,0,'2022-06-04 08:13:41'),
(680,1,48,1,'Verrückt, dass fallen wie fliegen ist für nen kleinen Moment.',57,0,0,'2022-06-04 08:13:41'),
(681,1,24,1,'Wer nicht weiß, wohin er will, der darf sich nicht wundern, wenn er ganz woanders ankommt.',57,0,0,'2022-06-04 08:13:42'),
(682,1,35,1,'Das Gute an der Dummheit ist, dass man sie nicht lernen muss.',56,0,0,'2022-06-04 08:13:42'),
(683,1,36,1,'Das Verlangen nach Gegenliebe ist nicht das Verlangen der Liebe, sondern der Eitelkeit.',56,0,0,'2022-06-04 08:13:42'),
(684,1,35,1,'Die Gegenwart trägt keine Verantwortung für die Vergangenheit.',56,0,0,'2022-06-04 08:13:42'),
(685,1,43,1,'Ein einziges Wort, gesprochen mit Überzeugung in voller Aufrichtigkeit und ohne zu schwanken während man Auge in Auge einander gegenüber steht, sagt bei weitem mehr als einige Dutzend Bogen beschriebenes Papier.',56,0,0,'2022-06-04 08:13:43'),
(686,1,12,1,'Gib mir innere Schönheit, denn äußere Schönheit werde ich wohl nie haben. Laß mich erkennen, daß am reichsten ist, wer weise ist, und den Göttern am ähnlichsten, wer genügsam ist.',56,0,0,'2022-06-04 08:13:43'),
(687,1,1,1,'Jeder ist nur soviel wert wie das Ziel seines Strebens.',56,0,0,'2022-06-04 08:13:43'),
(688,1,69,1,'Liebe ist nicht gleichbedeutend mit Beziehung. Liebe ist ein Phänomen. Ein Phänomen ist eine Erscheinung. Erscheinungen sind meist von kurzer Dauer.',56,0,0,'2022-06-04 08:13:43'),
(689,1,40,1,'Man muss sich durch die kleinen Gedanken, die einen ärgern, immer wieder hindurchfinden zu den großen Gedanken, die einen stärken.',56,0,0,'2022-06-04 08:13:43'),
(690,1,18,1,'Meditation ist das Reinigen des Geistes und Herzens vom Egoismus; durch diese Reinigung entsteht das richtige Denken, das allein den Menschen vom Leid befreien kann.',56,0,0,'2022-06-04 08:13:44'),
(691,1,35,1,'Nur mit Demut lernt man Menschen achten.',56,0,0,'2022-06-04 08:13:44'),
(692,1,17,1,'So lange der Geist versklavt ist, kann der Körper nie frei sein.',56,0,0,'2022-06-04 08:13:44'),
(693,1,17,1,'Wer das Böse ohne Widerspruch hinnimmt, arbeitet in Wirklichkeit mit ihm zusammen!',56,0,0,'2022-06-04 08:13:44'),
(694,1,64,1,'Wer hohe Türme bauen will, muß lange beim Fundament verweilen.',56,0,0,'2022-06-04 08:13:44'),
(695,1,27,1,'Amerika wird also, angeführt und aufgeweckt von der kubanischen Revolution, eine Aufgabe von großer, entscheidender Bedeutung haben: die Schaffung eines zweiten, dritten Vietnams.',55,0,0,'2022-06-04 08:13:45'),
(696,1,18,1,'Das Denken hat Unordnung hervorgebracht, weil es einen Konflikt zwischen dem, &quot;was ist&quot;, und dem, &quot;was sein sollte&quot;, zwischen Wirklichkeit und Theorie erzeugt hat.',55,0,0,'2022-06-04 08:13:45'),
(697,1,7,1,'Das Nahen des Todes und auch der Tod selbst, die Auflösung des physischen Körpers, sind immer eine große Möglichkeit für spirituelles Erwachen. Leider wird diese Chance in den meisten Fällen verpasst, weil wir in einer Kultur leben, die vom Tod fast kein Verständnis hat.',55,0,0,'2022-06-04 08:13:45'),
(698,1,17,1,'Der alte Grundsatz Auge um Auge macht schließlich alle blind.',55,0,0,'2022-06-04 08:13:45'),
(699,1,22,1,'Die Geschichte lehrt die Menschen, daß die Geschichte die Menschen nichts lehrt.',55,0,0,'2022-06-04 08:13:45'),
(700,1,50,1,'Die guten Zeiten von heute sind die traurigen Gedanken von Morgen.',55,0,0,'2022-06-04 08:13:45'),
(701,1,29,1,'Die meisten Menschen legen ihre Kindheit ab wie einen alten Hut. Sie vergessen sie wie eine Telefonnummer, die nicht mehr gilt. Ihr Leben kommt ihnen vor wie eine Dauerwurst, die sie allmählich aufessen, und was gegessen worden ist, existiert nicht mehr.',55,0,0,'2022-06-04 08:13:46'),
(702,1,44,1,'Eine Frau darf nur so viel zeigen, daß seine Phantasie geweckt wird.',55,0,0,'2022-06-04 08:13:46'),
(703,1,64,1,'Einen Fehler durch eine Lüge zu verdecken heißt, einen Flecken durch ein Loch zu ersetzen.',55,0,0,'2022-06-04 08:13:46'),
(704,1,33,1,'Einige meiner größten Fehler im Leben waren Haarschnitte.',55,0,0,'2022-06-04 08:13:46'),
(705,1,67,1,'Erfolg ist nichts endgültiges, Misserfolg nichts fatales: was zählt, ist der Mut weiterzumachen.',55,0,0,'2022-06-04 08:13:47'),
(706,1,53,1,'Gegen das Fehlschlagen eines Planes gibt es keinen besseren Trost, als auf der Stelle einen neuen zu machen oder bereitzuhalten.',55,0,0,'2022-06-04 08:13:47'),
(707,1,13,1,'Ich bin wie alle Menschen: Ich sehe die Welt so, wie ich sie gerne hätte, und nicht so, wie sie tatsächlich ist. (Der Alchimist)',55,0,0,'2022-06-04 08:13:47'),
