(817,1,25,1,'Auch Schulbildung war nur eine Falle. Das bißchen Bildung, das zu mir durchgedrungen war, hatte mich nur noch misstrauischer gemacht. Was waren denn Ärzte, Anwälte, Wissenschaftler? Doch auch nur Menschen, die sich die Freiheit nehmen ließen, selbständig zu denken und zu handeln. (Ham on Rye)',47,0,0,'2022-06-04 08:14:09'),
