(1091,1,20,1,'Ich weiß nicht, ob mein Leben nutzlos und bloß ein Mißverständnis war oder ob es einen Sinn hat. (Das Glasperlenspiel)',35,0,0,'2022-06-04 08:15:04'),
(1092,1,35,1,'Je größer die Wünsche, umso kleiner die Zufriedenheit.',35,0,0,'2022-06-04 08:15:05'),
(1093,1,16,1,'Jeder hat in tiefstem Dank derer zu gedenken, die Flammen in ihm entzündet haben.',35,0,0,'2022-06-04 08:15:05'),
(1094,1,20,1,'Man hat nur Angst, wenn man mit sich selber nicht einig ist. (Demian)',35,0,0,'2022-06-04 08:15:05'),
(1095,1,43,1,'Man kann vieles unbewusst wissen, indem man es nur fühlt, aber nicht weiß.',35,0,0,'2022-06-04 08:15:05'),
(1096,1,24,1,'Menschen mit einer neuen Idee gelten solange als Spinner, bis sich die Sache durchgesetzt hat.',35,0,0,'2022-06-04 08:15:05'),
(1097,1,22,1,'Reich wird man erst durch Dinge, die man nicht begehrt.',35,0,0,'2022-06-04 08:15:06'),
(1098,1,60,1,'Suche nicht nach Fehlern, suche nach Lösungen.',35,0,0,'2022-06-04 08:15:06'),
(1099,1,16,1,'Suche Stunden der Sammlung, damit die Seele zu dir sprechen kann.',35,0,0,'2022-06-04 08:15:06'),
(1100,1,16,1,'Tiefe Wahrheit tritt nicht anspruchsvoll auf.',35,0,0,'2022-06-04 08:15:06'),
(1101,1,65,1,'Und es ist immer ein und dasselbe, was in uns wohnt, Lebendes wie Totes, Waches und Schlafendes und Junges und Altes. Aus der Verschmelzung der Gegensätze entsteht das Leben, aus dem Gegensatz zwischen Mann und Frau: das Kind. Das Leben besteht aus dem Kampf der Gegensätze, denn: Gott ist Tag und Nacht, Winter und Sommer, Krieg und Frieden, Sattheit und Hunger.',35,0,0,'2022-06-04 08:15:07'),
(1102,1,29,1,'Wir müssen unseren Teil der Verantwortung für das, was geschieht, und für das, was unterbleibt, aus der öffentlichen Hand in die eigenen Hände zurücknehmen.',35,0,0,'2022-06-04 08:15:07'),
(1103,1,60,1,'Zusammenkommen ist ein Beginn, zusammenbleiben ist ein Fortschritt, zusammenarbeiten ist ein Erfolg.',35,0,0,'2022-06-04 08:15:07'),
(1104,1,19,1,'Als ich ein kleines Mädchen war, hat mir niemals jemand gesagt, dass ich hübsch bin. Allen kleinen Mädchen sollte gesagt werden, dass sie hübsch sind - auch wenn sie es nicht sind.',34,0,0,'2022-06-04 08:15:07'),
(1105,1,54,1,'Als ich mich wirklich selbst zu lieben begann, da erkannte ich, dass mich mein Denken armselig und krank machen kann, als ich jedoch meine Herzenskräfte anforderte, bekam der Verstand einen wichtigen Partner, diese Verbindung nenne ich heute “Herzensweisheit”.',34,0,0,'2022-06-04 08:15:07'),
(1106,1,46,1,'An Kaisern fehlt es uns nicht, nur an Persönlichkeiten.',34,0,0,'2022-06-04 08:15:08'),
(1107,1,63,1,'Damit es Frieden in der Welt gibt, müssen die Völker in Frieden leben.',34,0,0,'2022-06-04 08:15:08'),
(1108,1,71,1,'Das ärgerliche am Ärger ist, dass man sich schadet, ohne anderen zu nützen.',34,0,0,'2022-06-04 08:15:08'),
(1109,1,50,1,'Der Mensch ist ein in sich geschlossenes Universum.',34,0,0,'2022-06-04 08:15:08'),
(1110,1,8,1,'Der niederen Seele, die sich darauf beschränkt, den Garten zu bewundern, bleibt das Gesicht des Gärtners vorenthalten.',34,0,0,'2022-06-04 08:15:08'),
(1111,1,29,1,'Der verborgene Sinn allen Reisens ist es, Heimweh zu haben.',34,0,0,'2022-06-04 08:15:08'),
(1112,1,35,1,'Die beste Schönheitscreme für das Gesicht ist ein Lächeln.',34,0,0,'2022-06-04 08:15:09'),
(1113,1,35,1,'Die Natur lebt, ohne zu denken; deshalb leben manche Menschen ganz natürlich.',34,0,0,'2022-06-04 08:15:09'),
(1114,1,12,1,'Die Selbsterkenntnis ist die Bedingung praktischer Tüchtigkeit.',34,0,0,'2022-06-04 08:15:09'),
(1115,1,35,1,'Die Welt wurde von den Stärkeren aufgeteilt, nicht von den Klügeren.',34,0,0,'2022-06-04 08:15:09'),
(1116,1,46,1,'Du wirst nie glücklich werden wenn Du weiter danach forschst, woraus das Glück besteht. Du wirst niemals Leben, wenn Du nach dem Sinn des Lebens suchst.',34,0,0,'2022-06-04 08:15:10'),
(1117,1,38,1,'Eine der schönsten und herrlichsten Gaben Gottes ist die Musik, damit man viel Anfechtung und böse Gedanken vertreibt.',34,0,0,'2022-06-04 08:15:10'),
(1118,1,32,1,'Erst die Veränderungen wandeln die Erinnerungen in Wehmut.',34,0,0,'2022-06-04 08:15:10'),
(1119,1,81,1,'Es gibt nichts Schöneres, als geliebt zu werden, geliebt um seiner selbst willen oder vielmehr: trotz seiner selbst.',34,0,0,'2022-06-04 08:15:10'),
(1120,1,60,1,'Es hängt von dir selbst ab, ob du das neue Jahr als Bremse oder als Motor benutzen willst.',34,0,0,'2022-06-04 08:15:10'),
(1121,1,32,1,'Es ist nicht einfach in der Kunst verwertbare Spuren zu finden.',34,0,0,'2022-06-04 08:15:11'),
(1122,1,64,1,'Habgier bedeutet, dass ein Mensch nach etwas trachtet, das er nicht besitzt. Neid hingegen bedeutet, dass er sich über das ärgert, was ein anderer besitzt.',34,0,0,'2022-06-04 08:15:11'),
(1123,1,5,1,'Ich lebe mein Leben basierend auf zwei Prinzipien. Eins - ich lebe, als ob heute mein letzter Tag auf Erden wäre. Zwei - ich lebe heute, als ob ich für immer leben würde.',34,0,0,'2022-06-04 08:15:11'),
(1124,1,26,1,'Ich wollte niemals singen. I wollte nur die Rhytmusgitarre spielen - mich hinten verstecken und einfach nur spielen.',34,0,0,'2022-06-04 08:15:11'),
(1125,1,14,1,'Je mehr ich sehe, desto weniger weiß ich sicher.',34,0,0,'2022-06-04 08:15:12'),
(1126,1,67,1,'Manche Leute halten den Unternehmer für einen räudigen Wolf, den man totschlagen müsse. Andere sehen in ihm eine Kuh, die man ununterbrochen melken könne. Nur wenige erkennen in ihm das Pferd, das den Karren zieht.',34,0,0,'2022-06-04 08:15:12'),
(1127,1,35,1,'Verschwende deine Zeit nicht für jemand, der für dich keine Zeit hat !',34,0,0,'2022-06-04 08:15:12'),
(1128,1,20,1,'Von den vielen Welten, die der Mensch nicht von der Natur geschenkt bekam, sondern sich aus eigenem Geist erschaffen hat, ist die Welt der Bücher die größte.',34,0,0,'2022-06-04 08:15:12'),
(1129,1,70,1,'Wahlen allein machen noch keine Demokratie.',34,0,0,'2022-06-04 08:15:12'),
(1130,1,6,1,'Was auch immer auftaucht an Gefühlen, Gedanken, Objekten, ist beobachtbar, das heisst, es wird von etwas anderem gesehen. Was ist das, was beobachtet?',34,0,0,'2022-06-04 08:15:12'),
(1131,1,35,1,'Was nützen uns die schönsten Träume, wenn man danach aufwacht ?',34,0,0,'2022-06-04 08:15:13'),
(1132,1,35,1,'Wenn der Zweite der Erste werden will, haben beide ein Problem.',34,0,0,'2022-06-04 08:15:13'),
(1133,1,4,1,'Wenn du deinen Glauben verlieren willst, freunde dich mit einem Priester an.',34,0,0,'2022-06-04 08:15:13'),
(1134,1,57,1,'Wenn wir irgendwo hin möchten, oder uns in irgendeine Richtung entwickeln möchten, können wir nur von dort aus starten, wo wir gerade stehen. Wenn wir nicht wirklich wissen, wo wir stehen, kann es sein, dass wir uns nur im Kreis bewegen.',34,0,0,'2022-06-04 08:15:13'),
(1135,1,35,1,'An den Gabelungen des Lebensweges stehen keine Hinweisschilder.',33,0,0,'2022-06-04 08:15:13'),
(1136,1,63,1,'Auch der längste Marsch beginnt mit dem ersten Schritt.',33,0,0,'2022-06-04 08:15:14'),
(1137,1,41,1,'Besser ist es, ein Opfer menschlicher Schwäche zu werden, als zu den Starken und Unterdrückern zu gehören, welche die Blumen des Lebens mit ihren Füßen zertreten.',33,0,0,'2022-06-04 08:15:14'),
(1138,1,79,1,'Das Leben ist eine Komödie für den Denkenden und eine Tragödie für die, welche fühlen.',33,0,0,'2022-06-04 08:15:14'),
(1139,1,35,1,'Das Neue ist noch lange nicht das Bessere des Alten.',33,0,0,'2022-06-04 08:15:14'),
(1140,1,29,1,'Denkt an das fünfte Gebot: Schlagt eure Zeit nicht tot.',33,0,0,'2022-06-04 08:15:14'),
(1141,1,41,1,'Denn was heißt Sterben anderes, als nackt im Wind zu stehen und in der Sonne zu schmelzen! Und was heißt nicht mehr zu atmen anderes, als den Atem von seinen rastlosen Gezeiten zu befreien, damit er emporsteigt und sich entfaltet und ungehindert Gott suchen kann?',33,0,0,'2022-06-04 08:15:15'),
(1142,1,23,1,'Der einzige Mensch, der sich vernünftig benimmt, ist mein Schneider. Er nimmt jedesmal neu Maß, wenn er mich trifft, während alle anderen immer die alten Maßstäbe anlegen in der Meinung, sie paßten auch heute noch.',33,0,0,'2022-06-04 08:15:15'),
(1143,1,35,1,'Der Erfolg hat meistens eine lange Warteschlange.',33,0,0,'2022-06-04 08:15:15'),
(1144,1,41,1,'Der Fluss setzt seinen Weg zum Meer fort, ob das Rad der Mühle gebrochen ist oder nicht.',33,0,0,'2022-06-04 08:15:15'),
(1145,1,41,1,'Die Ewigkeit bewahrt nur die Liebe, weil sie von gleicher Natur ist.',33,0,0,'2022-06-04 08:15:16'),
(1146,1,59,1,'Die ganze Vielfalt, der ganze Reiz, die ganze Schönheit des Lebens besteht aus Schatten und Licht.',33,0,0,'2022-06-04 08:15:16'),
(1147,1,35,1,'Die Gegenwart ist zu kurz, um alles zu begreifen.',33,0,0,'2022-06-04 08:15:16'),
(1148,1,38,1,'Die Musik ist die beste Gottesgabe - und dem Satan sehr verhasst.',33,0,0,'2022-06-04 08:15:16'),
(1149,1,27,1,'Die Revolution ist kein Apfel, der vom Baum fällt, wenn er reif ist; man muss machen, dass er fällt.',33,0,0,'2022-06-04 08:15:16'),
(1150,1,41,1,'Die Schönheit liegt nicht im Antlitz. Die Schönheit ist ein Licht im Herzen.',33,0,0,'2022-06-04 08:15:17'),
(1151,1,32,1,'Die Verschwendung der Zeit ist der größte Betrug am denkenden Menschen.',33,0,0,'2022-06-04 08:15:17'),
(1152,1,1,1,'Ein unerschütterliches Herz den Dingen gegenüber, die von außen kommen - ein rechtschaffenes in denen, die von dir abhängen.',33,0,0,'2022-06-04 08:15:17'),
(1153,1,35,1,'Es gibt keinen Grund, ein schlechter Mensch zu sein.',33,0,0,'2022-06-04 08:15:17'),
(1154,1,19,1,'Gib einer Frau die richtigen Schuhe und sie kann die Welt erobern.',33,0,0,'2022-06-04 08:15:17'),
(1155,1,20,1,'Intellektuelle Erkenntnisse sind Papiere. Vertrauen hat immer nur der, der von Erfahrenem redet.',33,0,0,'2022-06-04 08:15:17'),
(1156,1,24,1,'Lasst uns dankbar sein, dass es Narren gibt. Ohne sie könnten wir anderen keinen Erfolg haben.',33,0,0,'2022-06-04 08:15:18'),
(1157,1,26,1,'Lieber tot sein, also cool zu sein.',33,0,0,'2022-06-04 08:15:18'),
(1158,1,40,1,'Man muss sich hüten, in den Erinnerungen zu wühlen, sich ihnen auszuliefern, wie man auch ein kostbares Geschenk nicht immerfort betrachtet, sondern nur zu besonderen Stunden und es sonst nur wie einen verborgenen Schatz, dessen man sich gewiss ist, besitzt; dann geht eine dauernde Freude und Kraft von dem Vergangenen aus.',33,0,0,'2022-06-04 08:15:18'),
(1159,1,35,1,'Manche Frauen haben kein Einkommen; aber hohe Verdienste.',33,0,0,'2022-06-04 08:15:18'),
(1160,1,35,1,'Manche Leute finden es doof, wenn andere klüger sind.',33,0,0,'2022-06-04 08:15:19'),
(1161,1,35,1,'Nicht jeder, der Kirchensteuern zahlt, ist ein Christ.',33,0,0,'2022-06-04 08:15:19'),
(1162,1,37,1,'Nirvana ist die endgültige Dimension des Lebens, ein Zustand von Gelassenheit, von Frieden und Freude. Es ist kein Zustand, den du nach deinem Tod erlangst. Du kannst Nirvana jetzt gleich beim bewußten Atmen, Gehen und Teetrinken berühren.',33,0,0,'2022-06-04 08:15:19'),
(1163,1,27,1,'Schaffen wir zwei, drei, viele Vietnam.',33,0,0,'2022-06-04 08:15:19'),
(1164,1,82,1,'Sei wer du bist und sag, was du fühlst. Denn die, die das stört, zählen nicht und die, die zählen, stört es nicht.',33,0,0,'2022-06-04 08:15:19'),
(1165,1,43,1,'Sie haben geweint und sich daran gewöhnt. An alles kann sich der Mensch, dieses Schwein, gewöhnen!',33,0,0,'2022-06-04 08:15:20'),
(1166,1,43,1,'Um die Welt zu ändern, sie neu zu gestalten, müssen zuvor die Menschen sich selbst umstellen.',33,0,0,'2022-06-04 08:15:20'),
(1167,1,35,1,'Unser Dasein ist ein Balanceakt zwischen möchten und können.',33,0,0,'2022-06-04 08:15:20'),
(1168,1,17,1,'Viele der schlechten Seiten in der amerikanischen Geschichte wurden verdunkelt und vergessen.',33,0,0,'2022-06-04 08:15:20'),
(1169,1,14,1,'Wenn Affen klavierspielen können, warum sollten Menschen nicht dazu singen?',33,0,0,'2022-06-04 08:15:20'),
(1170,1,83,1,'Wenn alles untergeht, bleib ich hier, bleib bei dir, du bei mir. Wenn nichts anderes übrig bleibt, bleibt das wir.',33,0,0,'2022-06-04 08:15:21'),
(1171,1,32,1,'Wir sind im gesamten Lebensreich die unterentwickelste Art. Wir suchen den Besitz und den Sinn des Lebens. Alle anderen Arten auf Erden sind über diesen Status hinaus. Sie haben Begriffen – fügen sich ihr Schicksal.',33,0,0,'2022-06-04 08:15:21'),
(1172,1,68,1,'Akzeptiere alles so wie es ist.',32,0,0,'2022-06-04 08:15:21'),
(1173,1,52,1,'Ändere die Welt; sie braucht es.',32,0,0,'2022-06-04 08:15:21'),
(1174,1,19,1,'Angst ist dumm - genauso wie etwas zu bereuen.',32,0,0,'2022-06-04 08:15:21'),
(1175,1,35,1,'Aus der Gerüchteküche kommen keine guten Speisen.',32,0,0,'2022-06-04 08:15:21'),
(1176,1,35,1,'Beklage nicht, was du ändern kannst !',32,0,0,'2022-06-04 08:15:22'),
(1177,1,35,1,'Dank hat meistens ein kurzes Verfalldatum.',32,0,0,'2022-06-04 08:15:22'),
(1178,1,41,1,'Das Gestern ist nichts anderes als die Erinnerung von Heute und das Morgen der Traum von heute. Ist nicht die Zeit wie die Liebe, ungeteilt und ungezügelt? Laßt das Heute die Vergangenheit mit Erinnerung umschlingen und die Zukunft mit Sehnsucht.',32,0,0,'2022-06-04 08:15:22'),
(1179,1,35,1,'Das Schlimme ist, dass die Bösen die Guten für böse halten.',32,0,0,'2022-06-04 08:15:22'),
(1180,1,41,1,'Denn Liebe, die etwas anderes sucht als die Offenbarung des eigenen Mysteriums, ist nicht Liebe, sondern nur ein ausgeworfenes Netz: und nur das Nutzlose wird gefangen.',32,0,0,'2022-06-04 08:15:23'),
(1181,1,35,1,'Der Neid ernährt den Streit.',32,0,0,'2022-06-04 08:15:23'),
(1182,1,6,1,'Die beste Lehre ist die, welche dich an das erinnert, was du bereits weisst, aber wieder vergessen hast. Es geht nicht darum, das was in meinem Kopf ist, in Deinen Kopf hinein zu stopfen. Es geht darum, dich an dein eigenes Wissen zu erinnern.',32,0,0,'2022-06-04 08:15:23'),
(1183,1,37,1,'Die Buddha-Natur ist - vor allem anderen - Achtsamkeit. Die Übung der Achtsamkeit ist die Übung, den Buddha im gegenwärtigen Moment zum Leben zu erwecken. Sie ist der wahre Buddha.',32,0,0,'2022-06-04 08:15:23'),
(1184,1,1,1,'Die Kunst zu leben hat mit der Fechtkunst mehr Ähnlichkeit als mit der Tanzkunst, insofern man auch auf unvorhergesehene Streiche gerüstet sein muss.',32,0,0,'2022-06-04 08:15:23'),
(1185,1,24,1,'Drei Dinge von unschätzbarem Wert hat Gott unserem Land gegeben: die Freiheit der Rede, die Freiheit des Glaubens und die Vernunft, beide nicht in Anspruch zu nehmen.',32,0,0,'2022-06-04 08:15:24'),
(1186,1,35,1,'Erfolg hat keine Geschwindigkeit.',32,0,0,'2022-06-04 08:15:24'),
(1187,1,22,1,'Es gibt Wichtigeres im Leben, als beständig dessen Geschwindigkeit zu erhöhen.',32,0,0,'2022-06-04 08:15:24'),
(1188,1,71,1,'Es ist schön, mit jemand schweigen zu können.',32,0,0,'2022-06-04 08:15:24'),
(1189,1,35,1,'Für das Gute gibt es keine Schlagzeilen.',32,0,0,'2022-06-04 08:15:25'),
(1190,1,35,1,'Für den Blick in die Seele gibt es keine Aussichtstürme.',32,0,0,'2022-06-04 08:15:25'),
(1191,1,73,1,'Für die lernende Seele hat das Leben auch in seinen dunkelsten Stunden einen unendlichen Wert.',32,0,0,'2022-06-04 08:15:25'),
(1192,1,84,1,'In jeder Sekunde, die wir mit einem anderen Menschen Zeit verbringen, nutzen wir dessen Lebenszeit. Sorgen wir dafür, dass er eine gute Zeit hat.',32,0,0,'2022-06-04 08:15:25'),
(1193,1,60,1,'Jeder, der aufhört zu lernen, ist alt, egal ob das mit zwanzig oder mit achtzig ist. Wer lernt, bleibt jung. Die größte Sache im Leben ist es, den eigenen Geist jung zu halten.',32,0,0,'2022-06-04 08:15:25'),
(1194,1,2,1,'Kein Geld ist vorteilhafter angewandt als das, um welches wir uns haben prellen lassen; denn wir haben dafür unmittelbar Klugheit eingehandelt.',32,0,0,'2022-06-04 08:15:25'),
(1195,1,70,1,'Lasst uns wenigstens den Weltuntergang verhindern. Es ist fünf vor zwölf, und wir haben nicht mehr viel Zeit.',32,0,0,'2022-06-04 08:15:26'),
(1196,1,35,1,'Mit Geld kann man viel bewegen; aber nur wenig das Herz berühren.',32,0,0,'2022-06-04 08:15:26'),
(1197,1,35,1,'Mit schlagenden Beweisen kann man Menschen umhauen.',32,0,0,'2022-06-04 08:15:26'),
(1198,1,65,1,'Nichts ist so beständig wie der Wechsel.',32,0,0,'2022-06-04 08:15:26'),
(1199,1,21,1,'Oft büßt das Gute ein, wer Besseres sucht.',32,0,0,'2022-06-04 08:15:26'),
(1200,1,35,1,'Ohne Dich und Euch und mich und uns kann die Welt nicht besser werden.',32,0,0,'2022-06-04 08:15:27'),
(1201,1,35,1,'Politik kann die Richtung verändern; aber nicht die Menschen.',32,0,0,'2022-06-04 08:15:27'),
(1202,1,52,1,'Reden über Angelegenheiten, die durch Reden nicht entschieden werden können, muß man sich abgewöhnen.',32,0,0,'2022-06-04 08:15:27'),
(1203,1,16,1,'Unser Nächster ist nicht nur der Mensch. Unsere Nächsten sind alle Wesen. Deshalb glaube ich, daß der Begriff der Ehrfurcht vor dem Leben unseren Gedanken der Humanität mehr Tiefe, mehr Größe und mehr Wirksamkeit verleiht. Die Probleme sind nur durch Gesinnung zu lösen!',32,0,0,'2022-06-04 08:15:27'),
(1204,1,53,1,'Unsere Freiheit ist heute lediglich der Entschluß, die Freiheit zu erkämpfen.',32,0,0,'2022-06-04 08:15:28'),
(1205,1,56,1,'Verreise niemals mit jemandem, den du nicht liebst.',32,0,0,'2022-06-04 08:15:28'),
(1206,1,35,1,'Viele Menschen warten auf den Erfolg, anstatt dafür zu arbeiten.',32,0,0,'2022-06-04 08:15:28'),
(1207,1,21,1,'Wäre jeder Tag ein Feiertag, sich vergnügen wäre so ermüdend wie arbeiten.',32,0,0,'2022-06-04 08:15:28'),
(1208,1,35,1,'Wenn unsere Zeit gekommen ist, gehen wir.',32,0,0,'2022-06-04 08:15:28'),
(1209,1,37,1,'Wenn wir in das tiefste Innere einer Blume blicken, sehen wir in ihr Wolken, Sonnenschein, Minerale, Zeit, Erde und alles andere im Kosmos. Ohne Wolken könnte es keinen Regen geben und so auch keine Blume.',32,0,0,'2022-06-04 08:15:28'),
(1210,1,35,1,'Wenn wir nicht mitleiden, sollten wir nicht mitstöhnen.',32,0,0,'2022-06-04 08:15:29'),
(1211,1,35,1,'Wer aus Aphorismen nichts lernt, der hat nichts verstanden.',32,0,0,'2022-06-04 08:15:29'),
(1212,1,35,1,'Wer den bequemsten Weg sucht, der erreicht keinen Gipfel.',32,0,0,'2022-06-04 08:15:29'),
(1213,1,61,1,'Wer eine Not erblickt und wartet, bis er um Hilfe gebeten wird, ist ebenso schlecht, als ob er sie verweigert hätte.',32,0,0,'2022-06-04 08:15:29'),
(1214,1,35,1,'Wer nicht nach dem Guten strebt, hat sein Leben nicht gelebt.',32,0,0,'2022-06-04 08:15:30'),
(1215,1,48,1,'Alles endet, aber nie die Musik.',31,0,0,'2022-06-04 08:15:30'),
