(2402,1,38,1,'Ohne Verstand, Weisheit und Gesetze können weder Türken noch Tataren leben und haushalten.',12,0,0,'2022-06-04 08:19:32'),
(2403,1,75,1,'Paradoxerweise habe ich in eben derselben Zeit, da unsere Welt im Moralischen zurückstürzte um ein Jahrtausend, dieselbe Menschheit im Technischen und Geistigen sich zu ungeahnten Taten erheben sehen, mit einem Flügelschlag alles in Millionen Jahren Geleistete überholend. Nie bis zu unserer Stunde hat sich die Menschheit als Gesamtheit teuflischer gebärdet und nie so Gottähnliches geleistet.',12,0,0,'2022-06-04 08:19:32'),
(2404,1,56,1,'Sobald wir einmal im Krieg sind gibt es nur eine Sache zu tun. Er muss gewonnen werden. Die Niederlage lässt schlimmere Dinge geschehen, als alle Dinge die jemals im Krieg geschehen können.',12,0,0,'2022-06-04 08:19:32'),
(2405,1,58,1,'Triffst du einen Menschen, mit dem zu reden sich lohnt, und du redest nicht mit ihm, so hast du einen Menschen verfehlt. Triffst du einen Menschen, mit dem zu reden sich nicht lohnt, und du redest mit ihm, so hast du deine Worte vergeudet. Der Weise verfehlt weder einen Menschen, noch vergeudet er seine Worte.',12,0,0,'2022-06-04 08:19:33'),
(2406,1,34,1,'Um einen Mann zu schätzen, muss man ihn zu prüfen wissen.',12,0,0,'2022-06-04 08:19:33'),
(2407,1,66,1,'Was im Alten Testament „in umbra“ erscheint, enthüllt sich im Neuen Testament im Lichte der Wahrheit.',12,0,0,'2022-06-04 08:19:33'),
(2408,1,63,1,'Was ist ein wahres Geheimnis? Etwas, das für jeden offen da liegt - und der eine erkennt es, der andere jedoch nicht.',12,0,0,'2022-06-04 08:19:33'),
(2409,1,74,1,'Wenige Eltern nehmen heutzutage Rücksicht auf das, was ihnen ihre Kinder sagen. Der altmodische Respekt vor der Jugend stirbt fast aus.',12,0,0,'2022-06-04 08:19:33'),
(2410,1,66,1,'Wenn ein verkehrter Mann die rechten Mittel gebraucht, so wirkt das rechte Mittel verkehrt.',12,0,0,'2022-06-04 08:19:34'),
(2411,1,59,1,'Wenn es möglich wäre, bei Lebzeiten zu wissen, was nach dem Tode mit uns geschieht, würde niemand Angst vor dem Tode haben.',12,0,0,'2022-06-04 08:19:34'),
(2412,1,105,1,'Wenn man glücklich ist, soll man nicht noch glücklicher sein wollen.',12,0,0,'2022-06-04 08:19:34'),
(2413,1,49,1,'Wenn Sie einen anderen Menschen für Ihre Sache gewinnen wollen, müssen Sie ihn zuerst davon überzeugen, dass Sie sein aufrichtiger Freund sind.',12,0,0,'2022-06-04 08:19:34'),
(2414,1,63,1,'Wer gern Recht behält, den überhört man.',12,0,0,'2022-06-04 08:19:34'),
(2415,1,73,1,'Wer gute Menschen liebt, kann wenigstens nicht ganz verdorben sein.',12,0,0,'2022-06-04 08:19:35'),
(2416,1,95,1,'Wer keine schlechten Gedanken hat, begeht auch keine schlechten Taten.',12,0,0,'2022-06-04 08:19:35'),
(2417,1,38,1,'Wer mit dem Geist der Traurigkeit geplagt wird, der soll aufs höchste sich hüten und vorsehen, dass er nicht allein sei.',12,0,0,'2022-06-04 08:19:35'),
(2418,1,80,1,'Wer nicht an sich selbst glaubt, kann auch niemals an Gott glauben.',12,0,0,'2022-06-04 08:19:35'),
(2419,1,63,1,'Wer nicht streiten will, mit dem kann niemand streiten.',12,0,0,'2022-06-04 08:19:35'),
(2420,1,39,1,'Wer nicht täglich seine Furcht überwindet, hat die Lektion des Lebens nicht gelernt.',12,0,0,'2022-06-04 08:19:36'),
(2421,1,64,1,'Wer recht erkennen will, muss zuvor in richtiger Weise gezweifelt haben.',12,0,0,'2022-06-04 08:19:36'),
(2422,1,77,1,'Wir alle haben große Kraft in uns. Diese Kraft ist der Glaube an sich selbst. Es gibt wirklich eine Einstellung des Gewinnens. Du musst dich gewinnen sehen bevor du gewinnst. Und du musst hungrig sein. Du musst erobern wollen.',12,0,0,'2022-06-04 08:19:36'),
(2423,1,80,1,'Wir sind das, wozu uns unserer eigenen Gedanken gemacht haben. Achte darum auf das, was du denkst.',12,0,0,'2022-06-04 08:19:36'),
(2424,1,73,1,'Wir sind nicht auf der Welt, um glücklich zu werden, sondern um unsere Pflicht zu tun.',12,0,0,'2022-06-04 08:19:37'),
(2425,1,64,1,'Wir sollten das Leben verlassen wie ein Bankett: weder durstig noch betrunken.',12,0,0,'2022-06-04 08:19:37'),
(2426,1,74,1,'Zu einer glücklichen Ehe gehören meist mehr als zwei Personen.',12,0,0,'2022-06-04 08:19:37'),
(2427,1,38,1,'Aber es ist schwierig, dass einer, der durch Gaben des Geistes ausgezeichnet ist, sich nicht überheben soll.',11,0,0,'2022-06-04 08:19:37'),
(2428,1,62,1,'Allein im Bewusstsein der Sünde gibt es den Zugang zum Christentum, auf einem anderen Wege hineinkommen wollen ist Majestätsverbrechen gegen das Christentum.',11,0,0,'2022-06-04 08:19:37'),
(2429,1,65,1,'Alles fließt. Panta rhei.',11,0,0,'2022-06-04 08:19:37'),
(2430,1,60,1,'Alles kann immer noch besser gemacht werden, als es gemacht wird.',11,0,0,'2022-06-04 08:19:38'),
(2431,1,73,1,'Alles, was die Natur selbst anordnet, ist zu irgendeiner Absicht gut. Die ganze Natur überhaupt ist eigentlich nichts anderes, als ein Zusammenhang von Erscheinungen nach Regeln; und es gibt überall keine Regellosigkeit.',11,0,0,'2022-06-04 08:19:38'),
(2432,1,38,1,'Anmaßung ist der Kopf der Schlange.',11,0,0,'2022-06-04 08:19:38'),
(2433,1,39,1,'Auch wer um die ganze Welt reist, um das Schöne zu suchen, findet es nur, wenn er es in sich trägt.',11,0,0,'2022-06-04 08:19:38'),
(2434,1,34,1,'Aus aller Ordnung entsteht zuletzt Pedanterie; um diese loszuwerden, zerstört man jene, und es geht eine Zeit hin, bis man gewahr wird, daß man wieder Ordnung machen müsse.',11,0,0,'2022-06-04 08:19:39'),
(2435,1,63,1,'Beim Streben nach Wissen wird täglich etwas hinzugefügt. Bei der Einübung ins Tao wird täglich etwas fallen gelassen.',11,0,0,'2022-06-04 08:19:39'),
(2436,1,38,1,'Bittet, rufet, schreiet, suchet, klopfet, poltert! Und das muss man für und für treiben ohne Aufhören.',11,0,0,'2022-06-04 08:19:39'),
(2437,1,80,1,'Bringt Licht den Armen, und bringt noch mehr Licht den Reichen, denn sie brauchen es mehr als die Armen.',11,0,0,'2022-06-04 08:19:39'),
(2438,1,65,1,'Das Denken ist der größte Vorzug, und die Weisheit besteht darin, die Wahrheit zu sagen und nach der Natur zu handeln, auf sie hinhörend.',11,0,0,'2022-06-04 08:19:39'),
(2439,1,73,1,'Daß die Welt im Argen liegt, ist eine Klage, die so alt ist wie die Geschichte.',11,0,0,'2022-06-04 08:19:40'),
(2440,1,62,1,'Das Evangelium weiß: das Verstehen kommt erst nach dem Gehorsam, nicht vorher.',11,0,0,'2022-06-04 08:19:40'),
(2441,1,43,1,'Das Leben ist ein Paradies, und alle sind wir im Paradiese, wir wollen es nur nicht wahrhaben; wenn wir es aber wahrhaben wollten, so würden wir morgen im Paradiese sein.',11,0,0,'2022-06-04 08:19:40'),
(2442,1,64,1,'Der Beginn aller Wissenschaften ist das Erstaunen, dass die Dinge sind, wie sie sind',11,0,0,'2022-06-04 08:19:40'),
(2443,1,58,1,'Der edle Mensch ist würdevoll, ohne überheblich zu sein; der niedrig Gesinnte ist überheblich, ohne würdevoll zu sein.',11,0,0,'2022-06-04 08:19:41'),
(2444,1,63,1,'Der einen engen Verstand hat, hat kein breites Herz.',11,0,0,'2022-06-04 08:19:41'),
(2445,1,38,1,'Der ersparte Pfennig ist redlicher als der erworbene.',11,0,0,'2022-06-04 08:19:41'),
(2446,1,62,1,'Der Glaube ist das Gegenteil des Zweifels.',11,0,0,'2022-06-04 08:19:41'),
(2447,1,60,1,'Der Mann, der seine größte Kapazität für die Arbeit und das Denken reserviert hat, ist der Mann, der zwangsläufig Erfolg haben wird.',11,0,0,'2022-06-04 08:19:41'),
(2448,1,74,1,'Der Mensch ist vielerlei, aber vernünftig ist er nicht.',11,0,0,'2022-06-04 08:19:41'),
(2449,1,43,1,'Der Mensch kann nicht bestehen, ohne etwas anzubeten.',11,0,0,'2022-06-04 08:19:42'),
(2450,1,23,1,'Der Mensch kann wohl die höchsten Gipfel erreichen, aber verweilen kann er dort nicht lange.',11,0,0,'2022-06-04 08:19:42'),
(2451,1,43,1,'Der Mensch verlangt nicht so sehr nach Gott als nach dem Wunder.',11,0,0,'2022-06-04 08:19:42'),
(2452,1,62,1,'Der Tyrann stirbt und seine Herrschaft ist vorüber; der Märtyrer stirbt und seine Herrschaft beginnt.',11,0,0,'2022-06-04 08:19:42'),
(2453,1,73,1,'Der Wille der Kinder muss nicht gebrochen, sondern nur in der Art gelenkt werden, dass er den natürlichen Hindernissen nachgebe.',11,0,0,'2022-06-04 08:19:42'),
(2454,1,38,1,'Des Menschen Herz ist wie Quecksilber, jetzt da, bald anderswo, heute so, morgen anders gesinnt.',11,0,0,'2022-06-04 08:19:43'),
(2455,1,49,1,'Des Nächsten Leid zu lindern hilft einem, das eigene zu vergessen.',11,0,0,'2022-06-04 08:19:43'),
(2456,1,71,1,'Die Basis einer gesunden Ordnung ist ein großer Papierkorb.',11,0,0,'2022-06-04 08:19:43'),
(2457,1,65,1,'Die Grenzen der Seele wirst du nicht finden, auch wenn du alle Wege durchwanderst. So tiefen Grund hat sie.',11,0,0,'2022-06-04 08:19:43'),
(2458,1,34,1,'Die Kunst ist eine Vermittlerin des Unaussprechlichen.',11,0,0,'2022-06-04 08:19:44'),
(2459,1,66,1,'Die Psychopathologie der Massen ist in der Psychologie des Einzelnen verwurzelt.',11,0,0,'2022-06-04 08:19:44'),
(2460,1,39,1,'Die ursprüngliche Weisheit ist Intuition, während alles spätere Wissen angelernt ist.',11,0,0,'2022-06-04 08:19:44'),
(2461,1,59,1,'Die Vernunft drückt das Gesetz der Notwendigkeit aus, das Bewußtsein das Wesen der Freiheit.',11,0,0,'2022-06-04 08:19:44'),
(2462,1,97,1,'Die Wahrheit ist oftmals schmerzlicher als die Lüge, in dem Moment wünscht man sich, es sei eine Lüge.',11,0,0,'2022-06-04 08:19:44'),
(2463,1,36,1,'Die Wissenschaft nötigt uns, den Glauben an einfache Kausalitäten aufzugeben.',11,0,0,'2022-06-04 08:19:44'),
(2464,1,82,1,'Du weißt, dass Du verliebt bist, wenn Du nicht einschlafen kannst, weil die Realität endlich besser ist als Deine Träume.',11,0,0,'2022-06-04 08:19:45'),
(2465,1,38,1,'Ein Christ ist ein solcher Mensch, der gar keinen Hass noch Feindschaft wider jemand weiß, keinen Zorn noch Rache in seinem Herzen hat, sondern eitel Liebe, Sanftmut und Wohltat.',11,0,0,'2022-06-04 08:19:45'),
