(2467,1,55,1,'Erfolg hat nur der, der etwas tut, während er auf den Erfolg wartet.',11,0,0,'2022-06-04 08:19:45'),
(2468,1,75,1,'Erst das Leiden hat der Menschheit das Gefühl der Religion, den Gedanken eines Gottes erschaffen.',11,0,0,'2022-06-04 08:19:46'),
(2469,1,81,1,'Es gibt ein Schweigen, das lügt.',11,0,0,'2022-06-04 08:19:46'),
(2470,1,24,1,'Es gibt Leute, die den Schuljungen verlachen und ihn leichtfertig und oberflächlich nennen. Dabei war es ein Schuljunge, der gesagt hat: &quot;Glaube ist, wenn man was glaubt und weiß, es ist nicht so.&quot;',11,0,0,'2022-06-04 08:19:46'),
(2471,1,89,1,'Es interessiert mich nicht, der reichste Mann am Friedhof zu sein. Was mich interessiert, ist am Abend ins Bett zu gehen und mir zu sagen, dass wir etwas wundervolles vollbracht haben.',11,0,0,'2022-06-04 08:19:46'),
(2472,1,60,1,'Es ist gefährlich, einen extrem fleißigen Bürokollegen einzustellen, weil die anderen Mitarbeiter ihm dann dauernd zuschauen.',11,0,0,'2022-06-04 08:19:46'),
(2473,1,60,1,'Fast jeder kann sich eine Idee ausdenken. Was wirklich zählt, ist die Entwicklung zu einem praktischen Produkt.',11,0,0,'2022-06-04 08:19:46'),
(2474,1,52,1,'Geldleute lesen gründlicher als Bücherliebhaber - sie wissen besser, was für Nachteile aus flüchtiger Lektüre entstehen.',11,0,0,'2022-06-04 08:19:47'),
(2475,1,21,1,'Gerücht ist eine Pfeife, die Argwohn, Eifersucht, Vermutung bläst.',11,0,0,'2022-06-04 08:19:47'),
(2476,1,102,1,'Ich finde den Fernseher sehr lehrreich. Jedes mal, wenn ihn jemand anmacht, gehe ich in ein anderes Zimmer und lese ein Buch.',11,0,0,'2022-06-04 08:19:47'),
(2477,1,74,1,'Ich habe einen ganz einfachen Geschmack: Ich bin immer mit dem Besten zufrieden.',11,0,0,'2022-06-04 08:19:47'),
(2478,1,23,1,'Ich wünschte ein Shakespeare zu sein und wurde ein Shaw.',11,0,0,'2022-06-04 08:19:48'),
(2479,1,91,1,'Ich würde gern leben wie ein armer Mann mit einem Haufen Geld.',11,0,0,'2022-06-04 08:19:48'),
(2480,1,43,1,'In jeder Gesellschaft gibt es das so genannte \'goldene Mittelmaß\', das Anspruch auf den ersten Platz erhebt. Diese Leute der goldenen Mitte sind schrecklich von sich eingenommen. Sie sind diejenigen, die auf jeden Neuerer den ersten Stein werfen.',11,0,0,'2022-06-04 08:19:48'),
(2481,1,46,1,'Jede Minute des Lebens trägt in sich ihren Wert als Wunder und ihr Gesicht ewiger Jugend.',11,0,0,'2022-06-04 08:19:48'),
(2482,1,106,1,'Jeder Abend ist die letzte Chance, jeder Morgen ein neuer Anfang.',11,0,0,'2022-06-04 08:19:48'),
(2483,1,97,1,'Jeder hat mal den Gedanken oder die Angst, dass man für die Person, die man liebt, nicht gut genug sei.',11,0,0,'2022-06-04 08:19:49'),
(2484,1,73,1,'Lachen: ein Affekt aus der plötzlichen Verwandlung einer gespannten Erwartung in nichts.',11,0,0,'2022-06-04 08:19:49'),
(2485,1,92,1,'Man kann einen seligen, seligsten Tag haben, ohne etwas Anderes dazu zu brauchen als blauen Himmel und grüne Erde.',11,0,0,'2022-06-04 08:19:49'),
(2486,1,59,1,'Man sollte doch glauben, daß die Berührung mit der Natur, diesem unmittelbaren Ausdruck der Schönheit und Güte, alles Böse im menschlichen Herzen verschwinden lassen müsse.',11,0,0,'2022-06-04 08:19:49'),
(2487,1,58,1,'Menschenliebe ist das Wesen der Sinnlichkeit, Menschenkenntnis das Wesen der Weisheit.',11,0,0,'2022-06-04 08:19:50'),
(2488,1,67,1,'Nach Meinung der Sozialisten ist es ein Laster, Gewinne zu erzielen. Ich bin dagegen der Ansicht, daß es ein Laster ist, Verluste zu machen.',11,0,0,'2022-06-04 08:19:50'),
(2489,1,66,1,'Nicht wir haben Geheimnisse, die wirklichen Geheimnisse haben uns.',11,0,0,'2022-06-04 08:19:50'),
(2490,1,79,1,'Nie werde ich, auch nicht auf eine Bitte hin, ein tödlich wirkendes Gift verabreichen oder auch nur einen Rat dazu erteilen; gleicherweise werde ich niemals einer Frau ein fruchtabtreibendes Zäpfchen geben.',11,0,0,'2022-06-04 08:19:50'),
(2491,1,75,1,'Nur der ganz Zerstückte kennt die Sehnsucht nach Vollendung. Nur der Getriebene erreicht die Unendlichkeit.',11,0,0,'2022-06-04 08:19:50'),
(2492,1,63,1,'Reisen ist besonders schön, wenn man nicht weiß, wohin es geht. Aber am allerschönsten ist es, wenn man nicht mehr weiß, woher man kommt.',11,0,0,'2022-06-04 08:19:50'),
(2493,1,69,1,'Religiöse Gefühle entstehen aus Angst und Kontrollverlust. Religionen entstehen aus dem Wunsch nach Macht. Glaube an dich selbst.',11,0,0,'2022-06-04 08:19:51'),
(2494,1,67,1,'Rußland ist ein Rätsel innerhalb eines Geheimnisses, umgeben von einem Mysterium.',11,0,0,'2022-06-04 08:19:51'),
(2495,1,24,1,'Sammle erst die Fakten, dann kannst du sie verdrehen, wie es dir passt.',11,0,0,'2022-06-04 08:19:51'),
(2496,1,81,1,'Sind wir glücklich, weil wir gut sind, oder sind wir gut, weil wir glücklich sind?',11,0,0,'2022-06-04 08:19:51'),
(2497,1,59,1,'Sterben ist Erwachen!',11,0,0,'2022-06-04 08:19:51'),
(2498,1,34,1,'Sucht nur die Menschen zu verwirren, sie zu befriedigen ist schwer.',11,0,0,'2022-06-04 08:19:52'),
(2499,1,71,1,'Was die Kirche nicht verbieten kann, das segnet sie.',11,0,0,'2022-06-04 08:19:52'),
(2500,1,80,1,'Was dir Frieden, Freude, Befriedigung und Heiterkeit verleiht und dein Herz ausweitet, das ist Tugend. Was dir Unruhe, Verdruß und Niedergeschlagenheit verursacht und dein Herz einengt, das ist die Sünde.',11,0,0,'2022-06-04 08:19:52'),
(2501,1,74,1,'Wenn ein Mann genau das tut, was eine Frau von ihm verlangt, hält sie nicht sehr viel von ihm.',11,0,0,'2022-06-04 08:19:52'),
(2502,1,95,1,'Wenn Wissen und Gelassenheit sich gegenseitig ergänzen, entstehen Harmonie und Ordnung.',11,0,0,'2022-06-04 08:19:53'),
(2503,1,58,1,'Wer in seinen Worten nicht maßvoll ist, von dem ist kaum zu erwarten, dass er handelt, wie er spricht.',11,0,0,'2022-06-04 08:19:53'),
(2504,1,59,1,'Wer keine Liebe zu seinen Mitmenschen empfindet, [...] der soll sich zurückhalten; er mag sich mit seiner eigenen Person und allen möglichen Dingen beschäftigen, nur nicht mit anderen Menschen.',11,0,0,'2022-06-04 08:19:53'),
(2505,1,63,1,'Wer viele Schätze anhäuft, hat viel zu verlieren.',11,0,0,'2022-06-04 08:19:53'),
(2506,1,24,1,'Wir haben viele Sündenböcke, aber der populärste ist die Vorsehung.',11,0,0,'2022-06-04 08:19:53'),
(2507,1,31,1,'Wissen ist das Kind der Erfahrung.',11,0,0,'2022-06-04 08:19:53'),
(2508,1,74,1,'Zuerst lieben die Kinder ihre Eltern. Nach einer gewissen Zeit fällen sie ihr Urteil über sie. Und selten, wenn überhaupt je, verzeihen sie ihnen.',11,0,0,'2022-06-04 08:19:54'),
(2509,1,57,1,'Achte einfach auf den jetzigen Moment, ohne zu versuchen, ihn auf irgendeine Weise zu verändern. Was passiert? Was fühlst du? Was siehst du? Was hörst du?',10,0,0,'2022-06-04 08:19:54'),
(2510,1,62,1,'Alle Not kommt vom Vergleichen!',10,0,0,'2022-06-04 08:19:54'),
(2511,1,65,1,'Alles Leben ist in Bewegung.',10,0,0,'2022-06-04 08:19:54'),
(2512,1,75,1,'Am Tage, da ich meinen Paß verlor, entdeckte ich mit achtundfünfzig Jahren, daß man mit seiner Heimat mehr verliert als einen Fleck umgrenzter Erde.',10,0,0,'2022-06-04 08:19:55'),
(2513,1,74,1,'Arbeit erscheint mir nie als Realität, sondern als Mittel, der Realität aus dem Weg zu gehen.',10,0,0,'2022-06-04 08:19:55'),
(2514,1,39,1,'Auf die Fragen unserer Sinne wird uns nur dann eine Antwort zuteil, wenn wir aller niedrigen Neugier entsagen und uns dem Daseinsstrom hingeben, der uns in das Geheimnis der Natur einführt.',10,0,0,'2022-06-04 08:19:55'),
(2515,1,98,1,'Aus Angst vor dem Hohn der anderen gibt sich der Mensch in der Öffentlichkeit dem Baden in der Dämmerung hin, schmiert Asche auf seine Stirn, ohne sich Gedanken darüber zu machen und wahre Wichtigkeit der Selbsterkenntnis zu verstehen, dass Gott in ihm wohnt.',10,0,0,'2022-06-04 08:19:55'),
(2516,1,55,1,'Das Einzige, was mich je entmutigt, ist der Gedanke an die vielen Dinge, die ich gerne tun möchte und die wenige Zeit, die ich dafür habe.',10,0,0,'2022-06-04 08:19:55'),
(2517,1,106,1,'Das Leben ist ein Rätsel, man muss es lösen, um viele Facetten, davon erleben zu dürfen.',10,0,0,'2022-06-04 08:19:56'),
(2518,1,65,1,'Das Weltall in seiner für alle Lebewesen gültigen Weltordnung war, ist und wird ewig sein ein in sich lebendes Feuer, das sich in ständigem Rhythmus entzündet und verlöscht.',10,0,0,'2022-06-04 08:19:56'),
(2519,1,56,1,'Das Zögern erhöht sich in Relation zum Risiko, im gleichen Maß zum Alter.',10,0,0,'2022-06-04 08:19:56'),
(2520,1,92,1,'Der Besitz macht uns nicht halb so glücklich, wie uns der Verlust unglücklich macht.',10,0,0,'2022-06-04 08:19:56'),
(2521,1,9,1,'Der Philosoph hat wie der Hausbesitzer immer Reparaturen.',10,0,0,'2022-06-04 08:19:57'),
(2522,1,67,1,'Der Preis der Größe heißt Verantwortung.',10,0,0,'2022-06-04 08:19:57'),
(2523,1,96,1,'Der Schein regiert die Welt, und die Gerechtigkeit ist nur auf der Bühne.',10,0,0,'2022-06-04 08:19:57'),
(2524,1,92,1,'Der schönste, reichste, beste und wahrste Roman, den ich je gelesen habe, ist die Geschichte.',10,0,0,'2022-06-04 08:19:57'),
