(3910,1,96,1,'Die goldne Zeit der Geistlichkeit fiel immer in die Gefangenschaft des menschlichen Geistes.',2,0,0,'2022-06-04 08:24:37'),
(3911,1,81,1,'Die großen Zufälle sind das Gesetz. Die Ordnung der Dinge kann nicht auf sie verzichten.',2,0,0,'2022-06-04 08:24:37'),
