(3916,1,105,1,'Die Menschen sind alle so geartet, dass sie lieber eine Lüge als eine Absage hören wollen.',2,0,0,'2022-06-04 08:24:38'),
(3917,1,136,1,'Die Menschen sind nicht immer, was sie scheinen, aber selten etwas Besseres.',2,0,0,'2022-06-04 08:24:38'),
(3918,1,92,1,'Die Menschen verraten ihre Absichten nie leichter und stärker, als wenn sie sie verfehlen.',2,0,0,'2022-06-04 08:24:39'),
(3919,1,108,1,'Die Natur brüstet sich nicht, dass sie Natur ist, noch hält das Wasser über die Technik des Fliessens eine Tagung ab. So viel Gerede wäre an die verschwendet, die es nicht brauchen. Der Mensch des Tao lebt im Tao wie ein Fisch im Wasser. Wenn wir dem Fisch beizubringen versuchen, dass Wasser physikalisch aus zwei Drittel Wasserstoff und einem Drittel Sauerstoff besteht, würde er sich schieflachen.',2,0,0,'2022-06-04 08:24:39'),
(3920,1,120,1,'Die Natur ist ein Brief Gottes an die Menschheit.',2,0,0,'2022-06-04 08:24:39'),
(3921,1,173,1,'Die Philosophen haben die Welt nur verschieden interpretiert - es kommt aber darauf an, sie zu verändern.',2,0,0,'2022-06-04 08:24:39'),
(3922,1,92,1,'Die Predigten sind Kehrbesen, die den Unrat von acht Tagen aus den Herzen der Zuhörer herausfegen.',2,0,0,'2022-06-04 08:24:39'),
(3923,1,174,1,'Die Sprache schlägt nicht nur Brücken in die Welt, sondern auch in die Einsamkeit.',2,0,0,'2022-06-04 08:24:39'),
