(3928,1,58,1,'Die Vorbedingung für alles wirkliche Wissen ist ein präzises Unterscheidungsvermögen für die Grenze zwischen dem, was man wirklich weiß, und dem, was man bloß meint.',2,0,0,'2022-06-04 08:24:41'),
(3929,1,74,1,'Die Wahrheit erkennen wir immer erst dann, wenn wir mit ihr absolut nichts mehr anzufangen vermögen.',2,0,0,'2022-06-04 08:24:41'),
(3930,1,95,1,'Die Wandlungen von »Richtig« sind unendlich und ebenso die Wandlungen von »Falsch«. Deshalb heißt es, daß es nichts Besseres gibt, auf sie zu antworten, als Klarheit.',2,0,0,'2022-06-04 08:24:41'),
(3931,1,176,1,'Die Welt besteht nicht nur aus Sonnenschein und Regenbogen Sie ist oft ein gemeiner und hässlicher Ort und es ist mir egal wie stark du bist. Sie wird dich in die Knie zwingen und dich zermahlen, wenn du es zu lässt. Du und ich...und auch sonst keiner, kann so hart zuschlagen wie das Leben! Aber der Punkt ist nicht der, wie hart einer zuschlagen kann. Es zählt bloß, wie viele Schläge er einstecken kann und ob er trotzdem weitermacht. Wie viel man einstecken kann und trotzdem weitermacht. Nur so gewinnt man!',2,0,0,'2022-06-04 08:24:41'),
(3932,1,162,1,'Die Welt bleibt ein profaner und sinnloser Ort, die absolute Wahrheit würde alle Menschen in den Wahnsinn treiben. Das Heilige und Metaphysische ist eine Erfindung der Menschen, um das Profane und Sinnlose und seine Sterblichkeit ignorieren zu können.',2,0,0,'2022-06-04 08:24:41'),
