(3934,1,168,1,'Die Würde der Tat erfordert ein Ergebnis und dieses soll schön und integrativ sein.',2,0,0,'2022-06-04 08:24:42'),
(3935,1,133,1,'Die Zeit heilt alle Wunden.',2,0,0,'2022-06-04 08:24:42'),
(3936,1,123,1,'Die Zeit im jetzt ist unser Leben und unser Leben im Sein ist einmalig!! Kein Mensch auf der ganzen Welt hat das selbe tolle Leben. Höchstens ein ähnliches. Doch aber gerade darum sollte man jede, wirklich jede, Sekunde genießen. Denn die Zeit ist unendlich das Leben nicht. Aber das Leben ist NUR im JETZT und HIER bis..................oder ! Michael Hülsen',2,0,0,'2022-06-04 08:24:42'),
(3937,1,92,1,'Die Zeit ist eine Larve der Ewigkeit.',2,0,0,'2022-06-04 08:24:42'),
(3938,1,168,1,'Die Zeit, in der der Bürger sich auf die Obrigkeit verlassen kann, dürfte wohl vorbei sein. Der Mensch braucht heute mehr Selbstführung, Selbstbestimmung, Selbstverantwortung und muss aus einem eigenständigen sozialen Vermögen den Staat repräsentieren.',2,0,0,'2022-06-04 08:24:43'),
(3939,1,177,1,'Die Zukunft zeigt sich in uns - lange bevor sie eintritt.',2,0,0,'2022-06-04 08:24:43'),
