(3953,1,108,1,'Ein Dunkles ist, das vollkommen war, ehe Himmel und Erde entstanden; ruhig, still, es steht allein ohne Wandel, es bewegt sich ohne Gefahr. Es könnte die Mutter aller Dinge sein, Ich weiß seinen Namen nicht und nenne es Tao.',2,0,0,'2022-06-04 08:24:46'),
