(3970,1,181,1,'Es gibt kein anderes Mittel als das nachforschende Fragen. Jeder Versuch, den Geist auf andere Weise zu beherrschen, wird ihn nur vorübergehend ruhig stellen. Atemkontrolle bewirkt einen Zustand der Ruhe, aber nur solange der Atem beherrscht ist; danach wird der Geist aufgrund verbliebener Eindrücke wieder umherschweifen.',2,0,0,'2022-06-04 08:24:49'),
(3971,1,91,1,'Es gibt keine abstrakte Kunst. Man muss immer mit etwas beginnen. Nachher kann man alle Spuren des Wirklichen entfernen. Dann besteht ohnehin keine Gefahr mehr, weil die Idee des Dinges inzwischen ein unauslöschliches Zeichen hinterlassen hat. Es ist das, was den Künstler in Gang gebracht, seine Ideen angeregt, seine Gefühle bewegt hat. Es ist das, was den Künstler ursprünglich in Gang gebracht, seine Ideen angeregt, seine Gefühle in Schwung gebracht hatte.',2,0,0,'2022-06-04 08:24:49'),
(3972,1,173,1,'Es gibt keine Landstraße für die Wissenschaft, und nur diejenigen haben Aussicht ihren hellen Gipfel zu erreichen, die die Ermüdung beim Erklettern ihrer steilen Pfade nicht scheuen.',2,0,0,'2022-06-04 08:24:50'),
(3973,1,165,1,'Es gibt keine Wahrheit. Es gibt nur eine Meinung im eigenen Interesse!',2,0,0,'2022-06-04 08:24:50'),
(3974,1,96,1,'Es gibt Taten, die sich keinem Menschenurteil mehr unterwerfen, nur den Himmel zum Schiedsmann erkennen.',2,0,0,'2022-06-04 08:24:50'),
(3975,1,74,1,'Es gibt weder moralische noch unmoralische Bücher. Bücher sind gut oder schlecht geschrieben, sonst nichts.',2,0,0,'2022-06-04 08:24:50'),
(3976,1,12,1,'Es ist besser, Unrecht zu leiden als Unrecht zu tun.',2,0,0,'2022-06-04 08:24:51'),
(3977,1,182,1,'Es ist das Gesicht hinter der Maske, die eine Person ausmacht.',2,0,0,'2022-06-04 08:24:51'),
(3978,1,125,1,'Es ist das, was du nicht tust, was du später im Alter bereust.',2,0,0,'2022-06-04 08:24:51'),
(3979,1,133,1,'Es ist erwiesen, dass die Dinge gar nicht anders sein können, als sie sind.',2,0,0,'2022-06-04 08:24:51'),
(3980,1,140,1,'Es ist nicht nötig dich deiner Tränen zu schämen. Tränen zeugen davon, dass auch ein Mann großen Mut besitzt - Mut um zu leiden.',2,0,0,'2022-06-04 08:24:51'),
(3981,1,87,1,'Es ist so wichtig, entspannt auszusehen.',2,0,0,'2022-06-04 08:24:52'),
(3982,1,103,1,'Es ist völlig ohne Bedeutung, wie sich der Mensch die Welt erklärt; fest steht nur, dass er dieses muss.',2,0,0,'2022-06-04 08:24:52'),
