(3987,1,116,1,'Europa benötigt in der kommenden Zeit einen neutralen und unparteiischen Rechtsstaat wie die Schweiz, welcher die Führung betreffs dem europäischen Prozess der Selbstfindung übernehmen kann.',2,0,0,'2022-06-04 08:24:53'),
(3988,1,154,1,'Faul sein ist wunderschön! Und dann muss man ja auch noch Zeit haben, einfach dazusitzen und vor sich hin zu schauen.',2,0,0,'2022-06-04 08:24:53'),
(3989,1,74,1,'Frauen sind Sphinxe ohne Rätsel.',2,0,0,'2022-06-04 08:24:53'),
(3990,1,140,1,'Freiheit droht in Willkür auszuarten, sofern sie nicht in Verantwortlichkeit gelebt wird.',2,0,0,'2022-06-04 08:24:54'),
(3991,1,81,1,'Für alles gibt es eine Theorie, die sich selber als »gesunden Menschenverstand« bezeichnet.',2,0,0,'2022-06-04 08:24:54'),
(3992,1,140,1,'Für gewöhnlich sieht der Mensch nur das Stoppelfeld der Vergänglichkeit; was er übersieht, sind die vollen Scheunen der Vergangenheit. Im Vergangensein ist nämlich nichts unwiederbringlich verloren, vielmehr alles unverlierbar geborgen.',2,0,0,'2022-06-04 08:24:54'),
(3993,1,184,1,'Für jene, die glauben, dass &quot;haben&quot; eine höchst natürliche Kategorie innerhalb der menschlichen Existenz ist, mag es überraschend sein, wenn sie erfahren, dass es in vielen Sprachen kein Wort für &quot;haben&quot; gibt.',2,0,0,'2022-06-04 08:24:54'),
(3994,1,185,1,'Ganz egal wie hart wir sind, Traumatisches hinterlässt immer eine Narbe. Es folgt uns bis Nachhause, es verändert unser Leben. Traumatisches wirft jeden aus der Bahn, aber vielleicht ist das ja gerade der Sinn, weil der Schmerz, die Angst, der ganze Schrott – vielleicht lässt uns genau das weiter machen, ist es das was uns antreibt. Vielleicht müssen wir erstmal die Orientierung verlieren, bevor wir klar sehen.',2,0,0,'2022-06-04 08:24:55'),
(3995,1,83,1,'Gefühle lauwarm - kein «Ja», kein «Nein»...',2,0,0,'2022-06-04 08:24:55'),
(3996,1,169,1,'Geiz ist ja eines der verlässlichsten Anzeichen tiefen Unglücklichseins.',2,0,0,'2022-06-04 08:24:55'),
(3997,1,86,1,'Geld kann zurückgezahlt werden, eine Güte wie die deine nicht.',2,0,0,'2022-06-04 08:24:55'),
(3998,1,157,1,'Gibt es eine bessere Form mit dem Leben fertig zu werden, als mit Liebe und Humor?',2,0,0,'2022-06-04 08:24:55'),
(3999,1,146,1,'Glücklichsein ist kein Zustand, sondern eine Fähigkeit.',2,0,0,'2022-06-04 08:24:56'),
(4000,1,130,1,'Gott ist meine Lieblings-Science-Fiction-Figur.',2,0,0,'2022-06-04 08:24:56'),
