(4489,1,181,1,'Der Geist ist feinstofflich. Wenn er Gehirn und Sinnesorgane durchdringt, die grobstofflich sind, entstehen Namen und Formen; wenn der Geist im Herzen ruht, verschwinden Namen und Formen. Den Geist nicht nach außen schweifen zu lassen, sondern im Herzen zurückzuhalten, wird antarmukha, Introversion, Nach-Innen-Gekehrtsein, genannt. Den Geist aus dem Herzen heraustreten zu lassen, wird bahirmukha, Extraversion, Nach-Außen-Gekehrtsein, genannt. Wenn der Geist im Herzen ruht, gibt es kein &quot;Ich&quot;, keine Gedanken, nur das ewige strahlende Selbst.',1,0,0,'2022-06-04 08:26:39'),
