(4502,1,237,1,'Der leibliche Aspekt des Glaubens wird von uns häufig übersehen. Indessen heißt Glauben haben soviel, wie Atem haben. Die Hoffnung lebt in unseren Augen, die Liebe wohnt in unseren Herzen; der Glaube erweitert unsere Inspiration, unsere Kraft zum Ein- und Ausatmen, läßt selbst unsere Verbindung mit dem Geist sichtbar werden, indem er uns ganz tiefen Atem schenkt trotz Drohung und Druck niederer Mächte. Wer Glauben besitzt, atmet tief und frei und ringt auch in Gefahr und Verzweiflung nicht nach Luft.',1,0,0,'2022-06-04 08:26:42'),
(4503,1,181,1,'Der Maßstab, mit dem der Fortschritt gemessen werden kann, ist das Ausmaß, in dem unerwünschte Gedanken fernbleiben und die Konzentration auf einen einzigen Gedanken gelingt.',1,0,0,'2022-06-04 08:26:42'),
