(5440,1,220,1,'Sei mutig und wage den Schritt in neue Erlebnisse! Solange du es nicht tust, wirst Du nie wissen, wie es ist, sondern nur daran denken, wie es hätte sein können.',1,0,0,'2022-06-04 08:30:02'),
(5441,1,106,1,'Sei selbst Freundlich, und inspiriere andere dazu, es auch zu sein.',1,0,0,'2022-06-04 08:30:02'),
(5442,1,106,1,'Sei vorsichtig bei den Kompromissen, die du mit dir aushandelst, sie werden schnell ein Gewinn, für deinen inneren Schweinehund.',1,0,0,'2022-06-04 08:30:02'),
(5443,1,106,1,'Sei zu einer anderen Seele so Behutsam, wie zu deiner eigenen.',1,0,0,'2022-06-04 08:30:03'),
(5444,1,210,1,'Sein, was wir sind, und werden, was wir werden können, das ist das Ziel des Lebens.',1,0,0,'2022-06-04 08:30:03'),
(5445,1,106,1,'Seinen inneren Frieden finden, um ihm dann mit andere Menschen zu Teilen.',1,0,0,'2022-06-04 08:30:03'),
(5446,1,106,1,'Seit in eurem Umfeld Freundlich zueinander, denn wir gestalten zusammen unsere eigene kleine Welt.',1,0,0,'2022-06-04 08:30:03'),
(5447,1,106,1,'Selten fühlt man sich der Freiheit Näher, als im Urlaub.',1,0,0,'2022-06-04 08:30:04'),
(5448,1,223,1,'Service Excellence braucht beides: Professionalität und Obsession.',1,0,0,'2022-06-04 08:30:04'),
(5449,1,223,1,'Service Excellence ist kein Betthupferl, sondern das Ergebnis exzellenter Führung.',1,0,0,'2022-06-04 08:30:04'),
(5450,1,223,1,'Service Excellence kostet Geld – keine Excellence Kunden.',1,0,0,'2022-06-04 08:30:04'),
(5451,1,223,1,'Service ist Beziehungsarbeit und Beziehungen müssen wachsen.',1,0,0,'2022-06-04 08:30:04'),
(5452,1,223,1,'Service ist die beste Digitalisierungsstrategie.',1,0,0,'2022-06-04 08:30:05'),
(5453,1,192,1,'Setze dir ein Muster und Vorbild und lebe danach, sowohl wenn du allein bist, als wenn du unter Leute kommst.',1,0,0,'2022-06-04 08:30:05'),
(5454,1,106,1,'Setze dir ein Ziel, um Nachts davon zu träumen, und Morgens aus dem Bett zu kommen.',1,0,0,'2022-06-04 08:30:05'),
(5455,1,213,1,'Sich im Licht der Zeit den Zeichen der Zeit zu stellen, bewahrt davor, dem Zeitgeist zu verfallen.',1,0,0,'2022-06-04 08:30:05'),
(5456,1,106,1,'Sich über das Glück der anderen nicht Ärgern, einfach nur Freuen und selbst Glücklich sein.',1,0,0,'2022-06-04 08:30:05'),
(5457,1,219,1,'Sie fragen mich, wie motiviert die Spieler sind? Ich kann nur eine Aussage darüber treffen, wie motiviert ich bin. Und wenn man das in Flaschen abfüllt, dann kommt man in den Knast, wenn man es verkauft.',1,0,0,'2022-06-04 08:30:06'),
(5458,1,106,1,'Sie gehen alle an mir vorbei, und ich bleibe zurück, doch ich bleibe dabei kämpfe für mein Glück',1,0,0,'2022-06-04 08:30:06'),
(5459,1,158,1,'Sie läuft davon, wir rennen ihr nach.',1,0,0,'2022-06-04 08:30:06'),
(5460,1,117,1,'Sie lügen und verraten ihre Brüder für Geld Doch verrätst du einen anderen, verrätst du dich selbst',1,0,0,'2022-06-04 08:30:06'),
(5461,1,213,1,'Sie müssen keine Angst haben zu verkümmern, Sie lesen ja gerade …',1,0,0,'2022-06-04 08:30:07'),
(5462,1,173,1,'Sie wissen es nicht. Aber sie tun es.',1,0,0,'2022-06-04 08:30:07'),
(5463,1,181,1,'Sind Sie im Herzen, dann wissen Sie, dass das Herz weder der Mittelpunkt noch der Umfang ist. Es gibt nichts getrennt von ihm.',1,0,0,'2022-06-04 08:30:07'),
(5464,1,223,1,'Smart Talk statt small talk – das ist Service Excellence.',1,0,0,'2022-06-04 08:30:07'),
(5465,1,137,1,'So lange der Mensch nicht im Höchsten frei, bei sich, selbständig ist, so lange kann er auch in Kunst und Wissenschaft nicht das Höchste erreichen.',1,0,0,'2022-06-04 08:30:07'),
(5466,1,289,1,'So lange dich die Liebe schmerzt, hast du dein wirkliches Selbst nicht gefunden, genauso wie du den goldenen Schlüssel zur Liebe nicht gefunden hast. Weil du ein flüchtiges Selbst liebst, ist deine Liebe flüchtig.',1,0,0,'2022-06-04 08:30:07'),
(5467,1,106,1,'So manche Träumerei, ist der Vorspann einer guten Idee.',1,0,0,'2022-06-04 08:30:08'),
(5468,1,106,1,'So mancher ungewollter Schritt, bringt die gewollte Veränderung.',1,0,0,'2022-06-04 08:30:08'),
(5469,1,106,1,'So manches liebende Herz, erleuchtet dem anderen den Weg.',1,0,0,'2022-06-04 08:30:08'),
(5470,1,160,1,'So weit du ausgehst aus allen Dingen, so weit, nicht weniger und nicht mehr, geht Gott ein mit all dem Seinen.',1,0,0,'2022-06-04 08:30:08'),
(5471,1,181,1,'So wie die Spinne ihren Faden absondert und wieder in sich aufnimmt, so projiziert auch der Verstand die Welt aus sich heraus und zieht sie wieder in sich zurück.',1,0,0,'2022-06-04 08:30:09'),
(5472,1,108,1,'So wie man jeden Punkt auf der Oberfläche einer Kugel als den Mittelpunkt der Oberfläche ansehen kann, so kann auch jedes Körperorgan und jegliches Wesen im Kosmos als seine Mitte und sein Herrscher gelten.',1,0,0,'2022-06-04 08:30:09'),
(5473,1,181,1,'Sobald der Geist aus dem Selbst heraus in Erscheinung tritt, tritt auch die Welt als real in Erscheinung, und das Selbst ist nicht mehr erkennbar; wenn aber das Selbst aufleuchtet und in Erscheinung tritt, verschwindet die Welt. Sucht man beharrlich nach dem Wesen des Geistes, wird der Geist aufhören zu existieren - was bleibt, ist das Selbst.',1,0,0,'2022-06-04 08:30:09'),
(5474,1,220,1,'Sobald Du keine Ausreden mehr hast, wirst Du erfolgreich.',1,0,0,'2022-06-04 08:30:09'),
(5475,1,161,1,'Sobald einer über die Staatsangelegenheiten sagt: &quot;Was gehts mich an?&quot; muss man damit rechnen, dass der Staat verloren ist.',1,0,0,'2022-06-04 08:30:09'),
(5476,1,261,1,'Solange der Mensch Tiere schlachtet, werden die Menschen auch einander töten. Wer Mord und Schmerz sät, kann nicht erwarten, Liebe und Freude zu ernten.',1,0,0,'2022-06-04 08:30:10'),
(5477,1,181,1,'Solange du die Verwirklichung des Selbst suchst, ist der Guru nötig. Der Guru ist das Selbst. Nimm den Guru als das wahre Selbst und dich selbst als das individuelle Selbst. Das Verschwinden dieses Gefühls der Zweiheit ist die Beseitigung des Nichtwissens. Solange die Zweiheit in dir beharrt, ist der Guru nötig. Da du dich mit dem Körper identifizierst, hältst du auch den Guru für einen Körper. Aber weder du noch der Guru sind Körper. Du bist das Selbst und der Guru auch. Dies ist die Erkenntnis, die durch die Verwirklichung des Selbst gewonnen wird.',1,0,0,'2022-06-04 08:30:10'),
(5478,1,106,1,'Solange es für dich Sinn ergibt was du machst, kann es für andere Ruhig Unsinn sein.',1,0,0,'2022-06-04 08:30:10'),
(5479,1,105,1,'Solange es geht, muss man Milde walten lassen, denn jeder kann sie brauchen.',1,0,0,'2022-06-04 08:30:10'),
(5480,1,105,1,'Solange keine Wolken da sind, freue man sich des himmlischen Lichts.',1,0,0,'2022-06-04 08:30:11'),
(5481,1,181,1,'Solange man glaubt, der Handelnde zu sein, gibt es Wünsche und Individualität. Wenn das verschwindet, leuchtet das Selbst auf. Die Vorstellung, der Handelnde zu sein, ist die Bindung, nicht die Handlung selbst.',1,0,0,'2022-06-04 08:30:11'),
(5482,1,151,1,'Sometimes I really want to ask \'\'What happened to the truth? Is it out of fashion?\'\'',1,0,0,'2022-06-04 08:30:11'),
(5483,1,223,1,'Spielen wir in der Champions League, aber bitte nicht vor leeren Rängen.',1,0,0,'2022-06-04 08:30:11'),
(5484,1,150,1,'Spiritualität schließt jede Be- und Verurteilung aus.',1,0,0,'2022-06-04 08:30:11'),
(5485,1,106,1,'Stark ist eine Gruppe, wenn sie die schwächsten nicht durch Mobbing ausschließt, sondern durch Liebe ins Leben mit einbezieht.',1,0,0,'2022-06-04 08:30:11'),
(5486,1,106,1,'Starke Menschen sind diejenigen die alles Einstecken, aber täglich wieder Liebe austeilen.',1,0,0,'2022-06-04 08:30:12'),
(5487,1,178,1,'Stelle Dir täglich 3 Fragen: Was hat mir heute am besten gefallen? Was habe ich heute gelernt? Wofür bin ich heute dankbar?',1,0,0,'2022-06-04 08:30:12'),
(5488,1,178,1,'Stelle viele Fragen, sonst bekommst Du keine Antworten.',1,0,0,'2022-06-04 08:30:12'),
(5489,1,90,1,'Sternschnuppen sind für Liebende die Pferde des Universums. Sie tragen zwei Menschen die sich lieben, an all die schönen Orte, die es rund um die Sterne gibt.',1,0,0,'2022-06-04 08:30:12'),
(5490,1,283,1,'Stets gelangweilt von sich selbst, fliehen viele zur Unvernunft.',1,0,0,'2022-06-04 08:30:13'),
(5491,1,126,1,'Stil ist richtiges Weglassen des Unwesentlichen.',1,0,0,'2022-06-04 08:30:13'),
(5492,1,181,1,'Still sein bedeutet nicht Verneinung des Tätigseins oder trägen Stillstand. Stille ist nicht bloße Verneinung von Gedanken und Regungen, sondern etwas Positiveres, als du dir vorstellen kannst. In dieser schweigenden Stille wurzelt Gott, wurzeln die Erlösten.',1,0,0,'2022-06-04 08:30:13'),
(5493,1,290,1,'Stille ist Nahrung, Schweigen ist Gift.',1,0,0,'2022-06-04 08:30:13'),
(5494,1,159,1,'Täglich ringt im Herzen eines Menschen die Angst mit dem Frieden um die Hochheit. Geh und schöpfe aus dem Brunnen der Dankbarkeit, und dein Herz wird mit innerem Frieden überflutet.',1,0,0,'2022-06-04 08:30:13'),
(5495,1,232,1,'Taten seien wichtiger als Worte. Dies behauptet man nur, weil Taten zählbar sind und Worte nicht.',1,0,0,'2022-06-04 08:30:14'),
(5496,1,195,1,'The magic of the art of life is &quot;viewing the big picture&quot; instead of loosing yourself in &quot;secondary theatres of war&quot;.',1,0,0,'2022-06-04 08:30:14'),
(5497,1,223,1,'The Moment of Truth wird zukünftig über Wohl oder Weh aller Unternehmen entscheiden.',1,0,0,'2022-06-04 08:30:14'),
(5498,1,106,1,'Tief in jedem Herzen steckt diese Magie, ein Zauber den wir durch unsere Handlungen erwecken, und die große Welt, wird von vielen kleinen Herzen mit Liebe erfüllt.',1,0,0,'2022-06-04 08:30:14'),
(5499,1,164,1,'To dream and never stop dreaming, to fight and never stop fighting, to love and never stop loving.',1,0,0,'2022-06-04 08:30:14'),
(5500,1,291,1,'Tod zu sein heißt, du bist Frei.',1,0,0,'2022-06-04 08:30:14'),
(5501,1,143,1,'cool',0,1,0,'2022-06-04 08:34:17'),
(5502,1,68,NULL,NULL,0,1,0,'2022-06-04 08:39:07');
